const e=[{tid:"4",englishTerm:"Accuracy",englishDefinition:'<span class="font-bold text-[#0055B2]">Accuracy</span> is the degree of how close a measurement is to the true value of the measurement.',spanishTerm:"Exactitud",spanishDefinition:'La <span class="font-bold text-[#0055B2]">exactitud</span> es el grado de locuáncercaqueestáuna mediciónestádel valor verdadero de la cantidad que se mide.'},{tid:"5",englishTerm:"Acute angle",englishDefinition:'An <span class="font-bold text-[#0055B2]">acute angle</span> is an angle whose measure is between 0 and 90.',spanishTerm:"Ángulo agudo",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">ángulo agudo</span> es un ángulo que mide entre 0 y 90 grados.'},{tid:"6",englishTerm:"Acute triangle",englishDefinition:'An <span class="font-bold text-[#0055B2]">acute triangle</span> has three acute angles.',spanishTerm:"Triángulo acutángulo",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">triángulo acutángulo</span> tiene los tres ángulos agudos.'},{tid:"7",englishTerm:"Additive identity",englishDefinition:'The <span class="font-bold text-[#0055B2]">additive identity</span> is 0. The sum of 0 and any number is that number. The sum of opposites is 0.',spanishTerm:"Identidad aditiva",spanishDefinition:'La <span class="font-bold text-[#0055B2]">identidad aditiva</span> es 0. La suma de 0 y cualquier número es ese mismo número. La suma de opuestos es 0.'},{tid:"8",englishTerm:"Additive inverse",englishDefinition:'The opposite or <span class="font-bold text-[#0055B2]">additive inverse</span> of any number a is –a. The sum of opposites is 0.',spanishTerm:"Inverso aditivo",spanishDefinition:'El opuesto o <span class="font-bold text-[#0055B2]">inverso aditivo</span> de cualquier número a es –a. La suma de los opuestos es 0.'},{tid:"9",englishTerm:"Adjacent angles",englishDefinition:'<span class="font-bold text-[#0055B2]">Adjacent angles</span> are two coplanar angles that have a common side and a common vertex but no common interior points.',spanishTerm:"Ángulos adyacentes",spanishDefinition:'Los <span class="font-bold text-[#0055B2]">ángulos adyacentes</span> son dos ángulos coplanares que tienen un lado común y el mismo vértice, pero no tienen puntos interiores comunes.'},{tid:"10",englishTerm:"Adjacent arcs",englishDefinition:'<span class="font-bold text-[#0055B2]">Adjacent arcs</span> are on the same circle and have exactly one point in common.',spanishTerm:"Arcos adyacentes",spanishDefinition:'Los <span class="font-bold text-[#0055B2]">arcos adyacentes</span> están en el mismo círculo y tienen exactamente un punto en común.'},{tid:"11",englishTerm:"Algebraic expression",englishDefinition:'A mathematical phrase that includes one or more variables and may contain constants and operations is called <span class="font-bold text-[#0055B2]">algebraic expression</span>.',spanishTerm:"Expresión algebraica",spanishDefinition:'Frase matemática que contiene una o más variables y que se denomina <span class="font-bold text-[#0055B2]">expresión algebraica</span>.'},{tid:"13",englishTerm:"Alternative hypothesis",englishDefinition:'An <span class="font-bold text-[#0055B2]">alternative hypothesis</span> is a statement that expresses that there is a difference between the parameter and the benchmark.',spanishTerm:"Hipótesis alternativa",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">hipótesis alternativa</span> es un enunciado que expresa que hay una diferencia entre el parámetro y el punto de referencia.'},{tid:"16",englishTerm:"Amplitude",englishDefinition:'The <span class="font-bold text-[#0055B2]">amplitude</span> of a periodic function is half the difference between the maximum and minimum values of the function.',spanishTerm:"Amplitud",spanishDefinition:'La <span class="font-bold text-[#0055B2]">amplitud</span> de una función periódica es la mitad de la diferencia entre los valores máximo y mínimo de la función.'},{tid:"18",englishTerm:"Angle bisector",englishDefinition:'An <span class="font-bold text-[#0055B2]">angle bisector</span> is a ray that divides an angle into two congruent angles.',spanishTerm:"Bisectriz de un ángulo",spanishDefinition:'La <span class="font-bold text-[#0055B2]">bisectriz de un ángulo</span> es una semirrecta que divide al ángulo en dos ángulos congruentes.'},{tid:"19",englishTerm:"Angle of depression",englishDefinition:'An <span class="font-bold text-[#0055B2]">angle of depression</span> is the angle from the horizontal down to a line of sight, and it is used to measure heights indirectly.',spanishTerm:"Ángulo de depresión",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">ángulo de depresión</span> es el ángulo de la horizontal hacia la línea de vista. Ángulo con que se miden indirectamente las alturas.'},{tid:"20",englishTerm:"Angle of elevation",englishDefinition:'An <span class="font-bold text-[#0055B2]">angle of elevation</span> is an angle from the horizontal up to a line of sight. It is used to measure heights indirectly.',spanishTerm:"Ángulo de elevación",spanishDefinition:'Ángulo de la horizontal hacia la línea de vista, conocido como <span class="font-bold text-[#0055B2]">ángulo de elevación</span>, y con el que se miden las alturas indirectamente.'},{tid:"22",englishTerm:"Apothem",englishDefinition:'The <span class="font-bold text-[#0055B2]">apothem</span> of a regular polygon is the distance from the center to a side.',spanishTerm:"Apotema",spanishDefinition:'La <span class="font-bold text-[#0055B2]">apotema</span> de un polígono regular es la distancia desde el centro hasta un lado.'},{tid:"24",englishTerm:"Arc length",englishDefinition:'The <span class="font-bold text-[#0055B2]">arc length</span> of an arc of a circle is the product of the circumference of the circle and the ratio of the corresponding central angle measure in degrees to 360. The arc length is also the product of the radius and central angle measure in radians.',spanishTerm:"Área",spanishDefinition:'El <span class="font-bold text-[#0055B2]">área</span> de una figura plana es la cantidad de unidades cuadradas que contiene la figura.'},{tid:"26",englishTerm:"Argument",englishDefinition:'In the complex plane, the <span class="font-bold text-[#0055B2]">argument</span> is the angle measured counterclockwise from the positive real axis to the segment connecting the complex number to the origin.',spanishTerm:"Argumento",spanishDefinition:'En el plano complejo, el <span class="font-bold text-[#0055B2]">argumento</span> es el ángulo que se mide en el sentido contrario a las manecillas del reloj desde el eje real positivo hasta el segmento.'},{tid:"27",englishTerm:"Arithmetic mean",englishDefinition:'The <span class="font-bold text-[#0055B2]">arithmetic mean</span>, or average, of two numbers is their sum divided by two.',spanishTerm:"Media aritmética",spanishDefinition:'La <span class="font-bold text-[#0055B2]">media aritmética</span>, o promedio, de dos números es su suma dividida por dos.'},{tid:"28",englishTerm:"Arithmetic sequence",englishDefinition:'A number sequence called an <span class="font-bold text-[#0055B2]">arithmetic sequence</span> is formed by adding a fixed number to each previous term to find the next term. The fixed number is called the common difference.',spanishTerm:"Progresión aritmética",spanishDefinition:'En una <span class="font-bold text-[#0055B2]">progresión aritmética</span> la diferencia entre términos consecutivos es un número constante. El número constante se llama la diferencia común.'},{tid:"29",englishTerm:"Arithmetic series",englishDefinition:'An <span class="font-bold text-[#0055B2]">arithmetic series</span> is a series whose terms form an arithmetic sequence.',spanishTerm:"Serie aritmética",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">serie aritmética</span> es una serie cuyos términos forman una progresión aritmética.'},{tid:"30",englishTerm:"Asymptote",englishDefinition:'A line that the graph of a function gets closer to as x or y gets larger in absolute value, which is known as an <span class="font-bold text-[#0055B2]">asymptote</span>.',spanishTerm:"Asíntota",spanishDefinition:'Línea recta a la que la gráfica de una función se acerca indefinidamente, mientras el valor absoluto de x o y aumenta, y que se conoce como <span class="font-bold text-[#0055B2]">asíntota</span>.'},{tid:"31",englishTerm:"Asymptotic behavior",englishDefinition:'A graph that approaches an asymptote exhibits <span class="font-bold text-[#0055B2]">asymptotic behavior</span>.',spanishTerm:"Comportamiento asintótico",spanishDefinition:'Una gráfica que se aproxima a una asíntota demuestra un <span class="font-bold text-[#0055B2]">comportamiento asintótico</span>.'},{tid:"32",englishTerm:"Augmented matrix",englishDefinition:'An <span class="font-bold text-[#0055B2]">augmented matrix</span> is a matrix that shows all coefficients and constants in a system of equations.',spanishTerm:"Matriz aumentada",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">matriz aumentada</span> es una matriz que muestra todos los coeficientes y las constantes en un sistema de ecuaciones.'},{tid:"33",englishTerm:"Auxiliary line",englishDefinition:'An <span class="font-bold text-[#0055B2]">auxiliary line</span> is a line that is added to a diagram to help explain relationships in proofs.',spanishTerm:"Línea auxiliar",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">línea auxiliar</span> es aquella que se le agrega a un diagrama para explicar la relación entre pruebas.'},{tid:"37",englishTerm:"Axis of symmetry",englishDefinition:'The <span class="font-bold text-[#0055B2]">axis of symmetry</span> is the line that divides a figure into two parts that are mirror images.',spanishTerm:"Eje de simetría",spanishDefinition:'El <span class="font-bold text-[#0055B2]">eje de simetría</span> es la recta que divide una figura en dos partes que son imágenes una de la otra.'},{tid:"41",englishTerm:"Bias",englishDefinition:'A <span class="font-bold text-[#0055B2]">bias</span> is a systematic error introduced by the sampling method.',spanishTerm:"Sesgo",spanishDefinition:'El <span class="font-bold text-[#0055B2]">sesgo</span> es un error sistemático introducido por medio del método de muestreo.'},{tid:"42",englishTerm:"Biconditional",englishDefinition:'A <span class="font-bold text-[#0055B2]">biconditional</span> statement is the combination of a conditional statement and its converse. A biconditional contains the words &quot;if and only if.&quot;',spanishTerm:"Bicondicional",spanishDefinition:'Un enunciado <span class="font-bold text-[#0055B2]">bicondicional</span> es la combinación de un enunciado condicional y su recíproco. El enunciado bicondicional incluye las palabras &quot;si y solo si&quot;.'},{tid:"43",englishTerm:"Bimodal",englishDefinition:'A <span class="font-bold text-[#0055B2]">bimodal</span> data set has two modes.',spanishTerm:"Bimodal",spanishDefinition:'Un conjunto <span class="font-bold text-[#0055B2]">bimodal</span> de datos tiene dos modas.'},{tid:"44",englishTerm:"Binomial",englishDefinition:'A <span class="font-bold text-[#0055B2]">binomial</span> is a polynomial of two terms.',spanishTerm:"Binomio",spanishDefinition:'Polinomio compuesto de dos términos que forman un <span class="font-bold text-[#0055B2]">binomio</span>.'},{tid:"45",englishTerm:"Binomial distribution",englishDefinition:'A <span class="font-bold text-[#0055B2]">binomial distribution</span> is a probability distribution that shows the probabilities of the outcomes of a binomial experiment.',spanishTerm:"Distribución binomial",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">distribución binomial</span> es una distribución de probabilidad que muestra las probabilidades de los resultados de un experimento binomial.'},{tid:"46",englishTerm:"Binomial experiment",englishDefinition:'A <span class="font-bold text-[#0055B2]">binomial experiment</span> is one in which the situation involves repeated trials. Each trial has two possible outcomes (success or failure), and the probability of success is constant throughout the trials.',spanishTerm:"Experimento binomial",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">experimento binomial</span> es un experimento que requiere varios ensayos. Cada ensayo tiene dos resultados posibles (éxito o fracaso), y la probabilidad de éxito es constante durante todos los ensayos.'},{tid:"49",englishTerm:"Bivariate",englishDefinition:'A set of data that uses two variables is <span class="font-bold text-[#0055B2]">bivariate</span>.',spanishTerm:"Bivariado",spanishDefinition:'Un conjunto de datos que usa dos variables es <span class="font-bold text-[#0055B2]">bivariado</span>.'},{tid:"50",englishTerm:"Box-and-whisker plot",englishDefinition:'A <span class="font-bold text-[#0055B2]">box-and-whisker plot</span> is a graph that summarizes data along a number line. The left whisker extends from the minimum to the first quartile. The box extends from the first quartile to the third quartile and has a vertical line through the median. The right whisker extends from the third quartile to the maximum.',spanishTerm:"Gráfica de cajas y bigotes",spanishDefinition:'<span class="font-bold text-[#0055B2]">Gráfica de cajas y bigotes</span> que resume los datos a lo largo de una recta numérica. El bigote izquierdo se extiende desde el valor mínimo del primer cuartil. La caja se extiende desde el primer cuartil hasta el tercer cuartil y tiene una línea vertical que atraviesa la mediana. El bigote derecho se extiende desde el tercer cuartil hasta el valor máximo.'},{tid:"51",englishTerm:"Branch",englishDefinition:'Each piece of a discontinuous graph is called a <span class="font-bold text-[#0055B2]">branch</span>.',spanishTerm:"Rama",spanishDefinition:'Cada segmento de una gráfica discontinua se llama <span class="font-bold text-[#0055B2]">rama</span>.'},{tid:"52",englishTerm:"Categorical variable",englishDefinition:'A <span class="font-bold text-[#0055B2]">categorical variable</span> is a variable for which the possible values belong to the limited set of qualitative responses.',spanishTerm:"Variable categórica",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">variable categórica</span> es una variable cuyos valores posibles pertenecen a un conjunto limitado de respuestas cualitativas.'},{tid:"53",englishTerm:"Causation",englishDefinition:'When a change in one quantity causes a change in a second quantity. A correlation between quantities does not always imply <span class="font-bold text-[#0055B2]">causation</span>.',spanishTerm:"Causalidad",spanishDefinition:'Cuando un cambio en una cantidad causa un cambio en una segunda cantidad. Una correlación entre las cantidades no implica siempre la <span class="font-bold text-[#0055B2]">causalidad</span>.'},{tid:"54",englishTerm:"Cavalieri's Principle",englishDefinition:`If two space figures have the same height and the same cross-sectional area at every level, then <span class="font-bold text-[#0055B2]">cavalieri's principle</span> states that they have the same volume.`,spanishTerm:"Principio de Cavalieri",spanishDefinition:'El <span class="font-bold text-[#0055B2]">principio de cavalieri</span> establece que si dos figuras sólidas tienen la misma altura y la misma área transversal en todos los niveles, entonces también tienen el mismo volumen.'},{tid:"55",englishTerm:"Ceiling function",englishDefinition:'A <span class="font-bold text-[#0055B2]">ceiling function</span> is a function that rounds numbers up to the nearest integer.',spanishTerm:"unción techo",spanishDefinition:'Función de <span class="font-bold text-[#0055B2]">unción techo</span> que redondea los números hacia arriba al entero más cercano.'},{tid:"60",englishTerm:"Center of rotation",englishDefinition:'A <span class="font-bold text-[#0055B2]">center of rotation</span> is the fixed point of a rotation.',spanishTerm:"Centro de rotación",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">centro de rotación</span> es el punto fijo de una rotación.'},{tid:"64",englishTerm:"Chord",englishDefinition:'A <span class="font-bold text-[#0055B2]">chord</span> of a circle is a segment whose endpoints are on the circle.',spanishTerm:"Cuerda",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">cuerda</span> de un círculo es un segmento cuyos extremos son dos puntos del círculo.'},{tid:"69",englishTerm:"Circumscribed about",englishDefinition:'A circle is <span class="font-bold text-[#0055B2]">circumscribed about</span> a polygon if the vertices of the polygon are on the circle. A polygon is circumscribed about a circle if all the sides of the polygon are tangent to the circle.',spanishTerm:"Circunscrito a",spanishDefinition:'Un círculo está <span class="font-bold text-[#0055B2]">circunscrito a</span> un polígono si los vértices del polígono están en el círculo. Un polígono está circunscrito a un círculo si todos los lados del polígono son tangentes al círculo.'},{tid:"70",englishTerm:"Closure property",englishDefinition:'A <span class="font-bold text-[#0055B2]">closure property</span> of a set of numbers means that the set is closed under an operation when the result of the operation is also part of the same set of numbers.',spanishTerm:"Propiedad de cerradura",spanishDefinition:'Un conjunto de números tiene la <span class="font-bold text-[#0055B2]">propiedad de cerradura</span> para una operación cuando el resultado de la operación también forma parte del mismo conjunto de números.'},{tid:"71",englishTerm:"Coefficient",englishDefinition:'The <span class="font-bold text-[#0055B2]">coefficient</span> is a numerical factor when a term has a variable.',spanishTerm:"Coeficiente",spanishDefinition:'El <span class="font-bold text-[#0055B2]">coeficiente</span> es factor numérico de un término que contiene una variable.'},{tid:"72",englishTerm:"Coefficient matrix",englishDefinition:'When representing a system of equations with a matrix equation, the matrix containing the coefficients of the system is the <span class="font-bold text-[#0055B2]">coefficient matrix</span>.',spanishTerm:"Matriz de coeficientes",spanishDefinition:'Al representar un sistema de ecuaciones con una ecuación de matriz, la matriz que contiene los coeficientes del sistema es la <span class="font-bold text-[#0055B2]">matriz de coeficientes</span>.'},{tid:"73",englishTerm:"Cofunction",englishDefinition:'A <span class="font-bold text-[#0055B2]">cofunction</span> is the trigonometric function for the complement of an angle.',spanishTerm:"Cofunción",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">cofunción</span> es la función trigonométrica para el complemento de un ángulo.'},{tid:"74",englishTerm:"Cofunction identities",englishDefinition:'A <span class="font-bold text-[#0055B2]">cofunction identities</span> are the equation that represents a trigonometric function with an equivalent trigonometric function related to its complement.',spanishTerm:"Identidades de cofunción",spanishDefinition:'Las <span class="font-bold text-[#0055B2]">identidades de cofunción</span> son ecuaciones que representan una función trigonométrica con una función trigonométrica equivalente relacionada con su complemento.'},{tid:"75",englishTerm:"Collinear points",englishDefinition:'<span class="font-bold text-[#0055B2]">Collinear points</span> lie on the same line.',spanishTerm:"Puntos colineales",spanishDefinition:'Los <span class="font-bold text-[#0055B2]">puntos colineales</span> son los que están sobre la misma recta.'},{tid:"77",englishTerm:"Combined variation",englishDefinition:'A <span class="font-bold text-[#0055B2]">combined variation</span> is a relation in which one variable varies with respect to each of two or more variables.',spanishTerm:"Variación combinada",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">variación combinada</span> es una relación en la que una variable varía con respecto a cada una de dos o más variables.'},{tid:"78",englishTerm:"Common difference",englishDefinition:'The <span class="font-bold text-[#0055B2]">common difference</span> is the difference between consecutive terms of an arithmetic sequence.',spanishTerm:"Diferencia común",spanishDefinition:'La <span class="font-bold text-[#0055B2]">diferencia común</span> es la diferencia entre los términos consecutivos de una progresión aritmética.'},{tid:"80",englishTerm:"Common ratio",englishDefinition:'The fixed number known as the <span class="font-bold text-[#0055B2]">common ratio</span> is used to find terms in a geometric sequence.',spanishTerm:"Razón común",spanishDefinition:'Número constante que se usa como <span class="font-bold text-[#0055B2]">razón común</span> para hallar los términos en una progresión geométrica.'},{tid:"81",englishTerm:"Compass",englishDefinition:'A <span class="font-bold text-[#0055B2]">compass</span> is a tool for drawing arcs and circles of different sizes and can be used to copy lengths.',spanishTerm:"Compás",spanishDefinition:'El <span class="font-bold text-[#0055B2]">compás</span> es un instrumento usado para dibujar círculos y partes de círculos, llamados arcos.'},{tid:"84",englishTerm:"Complementary angles",englishDefinition:'Two angles are <span class="font-bold text-[#0055B2]">complementary angles</span> if the sum of their measures is 90 degrees.',spanishTerm:"Ángulos complementarios",spanishDefinition:'Los <span class="font-bold text-[#0055B2]">ángulos complementarios</span> son dos ángulos cuya suma de medidas es igual a 90 grados.'},{tid:"87",englishTerm:"Complex fraction",englishDefinition:'A <span class="font-bold text-[#0055B2]">complex fraction</span> is a rational expression that has a fraction in its numerator or denominator, or in both its numerator and denominator.',spanishTerm:"Fracción compleja",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">fracción compleja</span> es una expresión racional en la que el numerador, el denominador o ambos son una fracción.'},{tid:"88",englishTerm:"Complex number",englishDefinition:'<span class="font-bold text-[#0055B2]">Complex number</span>s are numbers that can be written in the form a + bi, where a and b are real numbers and i is the square root of -1',spanishTerm:"Número complejo",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">número complejo</span> es una combinación de números reales y números imaginarios.'},{tid:"90",englishTerm:"Component form",englishDefinition:'The <span class="font-bold text-[#0055B2]">component form</span> of a vector describes the horizontal and vertical change of position from the intial point to the terminal point of the vector.',spanishTerm:"Componentes de un vector",spanishDefinition:'Los <span class="font-bold text-[#0055B2]">componentes de un vector</span> describen el cambio de posición horizontal y vertical desde el punto de inicio hasta el punto terminal del vector.'},{tid:"91",englishTerm:"Composite function",englishDefinition:'A <span class="font-bold text-[#0055B2]">composite function</span> is a combination of two functions such that the output from the first function becomes the input for the second function.',spanishTerm:"Función compuesta",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">función compuesta</span> es la combinación de dos funciones. La cantidad de salida de la primera función es la cantidad de entrada de la segunda función.'},{tid:"92",englishTerm:"Composite space figures",englishDefinition:'A <span class="font-bold text-[#0055B2]">composite space figures</span> are the combination of two or more figures into one object.',spanishTerm:"Figuras geométricas compuestas",spanishDefinition:'Las <span class="font-bold text-[#0055B2]">figuras geométricas compuestas</span> son la combinación de dos o más figuras en un mismo objeto.'},{tid:"93",englishTerm:"Composition of functions",englishDefinition:'A <span class="font-bold text-[#0055B2]">composition of functions</span> is the operation that forms composite functions.',spanishTerm:"Composición de funciones",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">composición de funciones</span> es la operación que forma funciones compuestas.'},{tid:"95",englishTerm:"Composition of transformations",englishDefinition:'A <span class="font-bold text-[#0055B2]">composition of transformations</span> is a transformation in which a second transformation is performed on the image of a first transformation.',spanishTerm:"Composición de transformaciones",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">composición de transformaciones</span> es una transformación en la cual una segunda transformación se realiza a partir de la imagen de la primera.'},{tid:"96",englishTerm:"Compound event",englishDefinition:'A <span class="font-bold text-[#0055B2]">compound event</span> is an event that consists of two or more events linked by the word and or the word or.',spanishTerm:"Suceso compuesto",spanishDefinition:'<span class="font-bold text-[#0055B2]">Suceso compuesto</span> que consiste en dos o más sucesos unidos por medio de la palabra y o la palabra o.'},{tid:"97",englishTerm:"Compound fraction",englishDefinition:'A <span class="font-bold text-[#0055B2]">compound fraction</span> is a fraction that has one or more fractions in the numerator and/or the denominator.',spanishTerm:"Fracción compuesta",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">fracción compuesta</span> está en forma de fracción y tiene una o más fracciones en el numerador o el denominador.'},{tid:"98",englishTerm:"Compound inequalities",englishDefinition:'Two inequalities that are joined by and or or, which together form the <span class="font-bold text-[#0055B2]">compound inequalities</span>.',spanishTerm:"Desigualdades compuestas",spanishDefinition:'Dos <span class="font-bold text-[#0055B2]">desigualdades compuestas</span> que están enlazadas por medio de una y o una o.'},{tid:"99",englishTerm:"Compound interest",englishDefinition:'Interest paid on both the principal and the interest that has already been accumulated as <span class="font-bold text-[#0055B2]">compound interest</span>.',spanishTerm:"Interés compuesto",spanishDefinition:'<span class="font-bold text-[#0055B2]">Interés compuesto</span> es aquel interés calculado tanto sobre el capital como sobre los intereses ya pagados.'},{tid:"100",englishTerm:"Compound interest formula",englishDefinition:'This <span class="font-bold text-[#0055B2]">compound interest formula</span> is an exponential model that is used to calculate the value of an investment when interest is compounded.',spanishTerm:"Fórmula de interés compuesto",spanishDefinition:'Esta <span class="font-bold text-[#0055B2]">fórmula de interés compuesto</span> es un modelo exponencial que se usa para calcular el valor de una inversión cuando el interés es compuesto.'},{tid:"101",englishTerm:"Compound statement",englishDefinition:'A <span class="font-bold text-[#0055B2]">compound statement</span> is a statement formed by combining two or more statements.',spanishTerm:"Enunciado compuesto",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">enunciado compuesto</span> es un enunciado que combina dos o más enunciados.'},{tid:"102",englishTerm:"Compression",englishDefinition:'A <span class="font-bold text-[#0055B2]">compression</span> is a transformation that decreases the distance between corresponding points of a graph.',spanishTerm:"Compresión",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">compresión</span> es una transformación que disminuye la distancia entre puntos que se corresponden en una gráfica.'},{tid:"104",englishTerm:"Concentric circles",englishDefinition:'<span class="font-bold text-[#0055B2]">Concentric circles</span> lie in the same plane and have the same center.',spanishTerm:"Círculos concéntricos",spanishDefinition:'Los <span class="font-bold text-[#0055B2]">círculos concéntricos</span> están en el mismo plano y tienen el mismo centro.'},{tid:"105",englishTerm:"Conclusion",englishDefinition:'The <span class="font-bold text-[#0055B2]">conclusion</span> is the part of an if-then statement (conditional) that follows then.',spanishTerm:"Conclusión",spanishDefinition:'La <span class="font-bold text-[#0055B2]">conclusión</span> es lo que sigue a la palabra entonces en un enunciado (condicional), si . . ., entonces. . . .'},{tid:"106",englishTerm:"Concurrent lines",englishDefinition:'<span class="font-bold text-[#0055B2]">Concurrent lines</span> are three or more lines that meet in one point. The point at which they meet is the point of concurrency.',spanishTerm:"Rectas concurrentes",spanishDefinition:'Las <span class="font-bold text-[#0055B2]">rectas concurrentes</span> son tres o más rectas que se unen en un punto. El punto en que se unen es el punto de concurrencia.'},{tid:"107",englishTerm:"Conditional",englishDefinition:'A <span class="font-bold text-[#0055B2]">conditional</span> is an if-then statement that relates a hypothesis, the part that follows if, to a conclusion, the part that follows then.',spanishTerm:"Condicional",spanishDefinition:'Un enunciado <span class="font-bold text-[#0055B2]">condicional</span> es del tipo si . . ., entonces. . . .'},{tid:"109",englishTerm:"Conditional relative frequency",englishDefinition:'<span class="font-bold text-[#0055B2]">Conditional relative frequency</span> is the quotient of a joint frequency in a two-way frequency table and the marginal frequency of the row or column in which the joint frequency appears.',spanishTerm:"Frecuencia relativa condicionada",spanishDefinition:'UnaF<span class="font-bold text-[#0055B2]">frecuencia relativa condicionada</span> es el conciente deununafrecuencia conjuntaen una tabla de frecuencias de doble entraday la frecuencia marginal de la fila o columna enla que laqueaparece lafrecuencia conjuntade una tabla de frecuencias de doble entrada.aparece.'},{tid:"110",englishTerm:"Cone",englishDefinition:'A <span class="font-bold text-[#0055B2]">cone</span> is a three-dimensional figure that has a circular base, a vertex not in the plane of the circle, and a curved lateral surface, as shown in the diagram. The altitude of a cone is the perpendicular segment from the vertex to the plane of the base. The height is the length of the altitude. In a right cone, the altitude contains the center of the base. The slant height of a right cone is the distance from the vertex to the edge of the base.',spanishTerm:"Cono",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">cono</span> es una figura tridimensional que tiene una base circular, un vértice que no está en el plano del círculo y una superficie lateral curvada (indicada en el diagrama). La altura de un cono es el segmento perpendicular desde el vértice hasta el plano de la base. La altura, por extensión, es la longitude de la altura. Un cono recto es un cono cuya altura contiene el centro de la base. La longitude de la generatriz de un cono recto es la distancia desde el vértice hasta el borde de la base.'},{tid:"112",englishTerm:"Congruent angles",englishDefinition:'<span class="font-bold text-[#0055B2]">Congruent angles</span> are angles that have the same measure.',spanishTerm:"Ángulos congruentes",spanishDefinition:'Los <span class="font-bold text-[#0055B2]">ángulos congruentes</span> son ángulos que tienen la misma medida.'},{tid:"113",englishTerm:"Congruent arcs",englishDefinition:'<span class="font-bold text-[#0055B2]">Congruent arcs</span> are arcs that have the same measure and are in the same circle or congruent circles.',spanishTerm:"Arcos congruentes",spanishDefinition:'<span class="font-bold text-[#0055B2]">Arcos congruentes</span> son arcos que tienen la misma medida y están en el mismo círculo o en círculos congruentes.'},{tid:"114",englishTerm:"Congruent circles",englishDefinition:'<span class="font-bold text-[#0055B2]">Congruent circles</span> are circles whose radii are congruent.',spanishTerm:"Círculos congruentes",spanishDefinition:'Los <span class="font-bold text-[#0055B2]">círculos congruentes</span> son círculos cuyos radios son congruentes.'},{tid:"115",englishTerm:"Congruent figures",englishDefinition:'Two figures are <span class="font-bold text-[#0055B2]">congruent figures</span> if there is a rigid motion that maps one figure on the other.',spanishTerm:"Figuras congruentes",spanishDefinition:'Dos figuras son <span class="font-bold text-[#0055B2]">figuras congruentes</span> si hay un movimiento rígido en el que una figura es imagen de la otra.'},{tid:"116",englishTerm:"Congruent polygons",englishDefinition:'<span class="font-bold text-[#0055B2]">Congruent polygons</span> are polygons that have corresponding sides congruent and corresponding angles congruent.',spanishTerm:"Polígonos congruentes",spanishDefinition:'Los <span class="font-bold text-[#0055B2]">polígonos congruentes</span> son polígonos cuyos lados correspondientes son congruentes y cuyos ángulos correspondientes son congruentes.'},{tid:"117",englishTerm:"Congruent segments",englishDefinition:'<span class="font-bold text-[#0055B2]">Congruent segments</span> are segments that have the same length.',spanishTerm:"Segmentos congruentes",spanishDefinition:'Los <span class="font-bold text-[#0055B2]">segmentos congruentes</span> son segmentos que tienen la misma longitud.'},{tid:"118",englishTerm:"Conic section",englishDefinition:'A <span class="font-bold text-[#0055B2]">conic section</span> is a curve formed by the intersection of a plane and a double cone.',spanishTerm:"Sección cónica",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">sección cónica</span> es una curva que se forma por la intersección de un plano con un cono doble.'},{tid:"119",englishTerm:"Conjecture",englishDefinition:'A <span class="font-bold text-[#0055B2]">conjecture</span> is a conclusion reached by using inductive reasoning.',spanishTerm:"Conjetura",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">conjetura</span> es una conclusión obtenida usando el razonamiento inductivo.'},{tid:"122",englishTerm:"Conjugates",englishDefinition:'The sum and the difference of the same two terms are called <span class="font-bold text-[#0055B2]">conjugates</span>.',spanishTerm:"Valores conjugados",spanishDefinition:'La suma y resta de los mismos dos términos que se consideran como <span class="font-bold text-[#0055B2]">valores conjugados</span>.'},{tid:"123",englishTerm:"Conjunction",englishDefinition:'A <span class="font-bold text-[#0055B2]">conjunction</span> is a compound statement formed by connecting two or more statements with the word and.',spanishTerm:"Conjunción",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">conjunción</span> es un enunciado compuesto que conecta dos o más enunciados por medio de la palabra y.'},{tid:"124",englishTerm:"Consecutive angles",englishDefinition:'<span class="font-bold text-[#0055B2]">Consecutive angles</span> of a polygon share a common side',spanishTerm:"Ángulos consecutivos",spanishDefinition:'Los <span class="font-bold text-[#0055B2]">ángulos consecutivos</span> de un polígono tienen un lado común.'},{tid:"125",englishTerm:"Consistent system",englishDefinition:'A system of linear equations is called <span class="font-bold text-[#0055B2]">consistent system</span> if it has at least one solution.',spanishTerm:"Sistema consistente",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">sistema consistente</span> de ecuaciones lineales es consistente si tiene por lo menos una solución.'},{tid:"127",englishTerm:"Constant matrix",englishDefinition:'When representing a system of equations with a matrix equation, the matrix containing the constants of the system is the <span class="font-bold text-[#0055B2]">constant matrix</span>.',spanishTerm:"Matriz de constantes",spanishDefinition:'Al representar un sistema de ecuaciones con una ecuación matricial, la matriz que contiene las constantes del sistema es la <span class="font-bold text-[#0055B2]">matriz de constantes</span>.'},{tid:"129",englishTerm:"Constant of variation",englishDefinition:'The <span class="font-bold text-[#0055B2]">constant of variation</span> is the ratio of the two variables in a direct variation and the product of the two variables in an inverse variation.',spanishTerm:"Constante de variación",spanishDefinition:'La <span class="font-bold text-[#0055B2]">constante de variación</span> es la razón de dos variables en una variación directa y el producto de las dos variables en una variación inversa.'},{tid:"130",englishTerm:"Constant ratio",englishDefinition:'The <span class="font-bold text-[#0055B2]">constant ratio</span> is the number that an exponential function repeatedly multiplies an initial amount by.',spanishTerm:"Razón constante",spanishDefinition:'El número por el que una cantidad inicial se multiplica repetidamente en una función exponencial, que se conoce como <span class="font-bold text-[#0055B2]">razón constante</span>.'},{tid:"131",englishTerm:"Constant term",englishDefinition:'A <span class="font-bold text-[#0055B2]">constant term</span> is a term with no variables.',spanishTerm:"Término constante",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">término constante</span> es un término que no tiene variables.'},{tid:"133",englishTerm:"Construction",englishDefinition:'A <span class="font-bold text-[#0055B2]">construction</span> is a geometric figure made with only a straightedge and compass.',spanishTerm:"Construcción",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">construcción</span> es una figura geométrica trazada solamente con una regla sin graduación y un compás.'},{tid:"134",englishTerm:"Continuous graph",englishDefinition:'A <span class="font-bold text-[#0055B2]">continuous graph</span> is a graph that has no jumps, breaks, or holes.',spanishTerm:"Gráfica continua",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">gráfica continua</span> es aquella que no tiene saltos, interrupciones o huecos.'},{tid:"135",englishTerm:"Continuous probability distribution",englishDefinition:'A <span class="font-bold text-[#0055B2]">continuous probability distribution</span> has as its events any of the infinitely many values in an interval of real numbers.',spanishTerm:"Distribución de probabilidad continua",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">distribución de probabilidad continua</span> tiene como sucesos a cual quiera del número infinito de valores en un intervalo de números reales.'},{tid:"137",englishTerm:"Contrapositive",englishDefinition:'The <span class="font-bold text-[#0055B2]">contrapositive</span> of the conditional "if p, then q" is the conditional "if not q, then not p." A conditional and its contrapositive always have the same truth value.',spanishTerm:"Contrapositivo",spanishDefinition:'El <span class="font-bold text-[#0055B2]">contrapositivo</span> del condicional &quot;si p, entonces q&quot; es el condicional &quot;si no q, entonces no p&quot;. Un condicional y su contrapositivo siempre tienen el mismo valor verdadero.'},{tid:"138",englishTerm:"Control group",englishDefinition:'In an experiment, the group chosen to not receive the treatment is the <span class="font-bold text-[#0055B2]">control group</span>.',spanishTerm:"Grupo controlado",spanishDefinition:'En un experimento, el grupo no manipulado es el <span class="font-bold text-[#0055B2]">grupo controlado</span>.'},{tid:"139",englishTerm:"Controlled experiment",englishDefinition:'In a <span class="font-bold text-[#0055B2]">controlled experiment</span>, you divide the sample into two groups. You impose a treatment on one group but not the other “control” group. Then you compare the effect on the treated group to the control group.',spanishTerm:"Experimento controlado",spanishDefinition:'En un <span class="font-bold text-[#0055B2]">experimento controlado</span>, se divide la muestra en dos grupos. Uno de los grupos se manipula y el otro grupo “controlado” se mantiene en su estado original. Luego se comparan el estado del grupo manipulado y el estado del grupo controlado.'},{tid:"140",englishTerm:"Convenience sample",englishDefinition:'In a <span class="font-bold text-[#0055B2]">convenience sample</span> you select any members of the population who are conveniently and readily available.',spanishTerm:"Muestra de conveniencia",spanishDefinition:'En una <span class="font-bold text-[#0055B2]">muestra de conveniencia</span> se selecciona a cualquier miembro de la población que está convenientemente disponible.'},{tid:"142",englishTerm:"Converse",englishDefinition:'The <span class="font-bold text-[#0055B2]">converse</span> is the statement obtained by reversing the hypothesis and conclusion of a conditional.',spanishTerm:"Expresión recíproca",spanishDefinition:'Enunciado que se obtiene al intercambiar la hipótesis y la conclusión de un enunciado condicional, lo que se conoce como una <span class="font-bold text-[#0055B2]">expresión recíproca</span>.'},{tid:"143",englishTerm:"Conversion factor",englishDefinition:'A <span class="font-bold text-[#0055B2]">conversion factor</span> is a ratio of two equivalent measures in different units.',spanishTerm:"Factor de conversión",spanishDefinition:'Razón de dos medidas equivalentes en unidades diferentes que se utiliza como un <span class="font-bold text-[#0055B2]">factor de conversión</span>.'},{tid:"145",englishTerm:"Coordinate geometry",englishDefinition:'The analytical use of algebra to study geometric properties of figures drawn on the coordinate plane is called <span class="font-bold text-[#0055B2]">coordinate geometry</span>.',spanishTerm:"Geometría de coordenadas",spanishDefinition:'El uso analítico del álgebra para estudiar las propiedades geométricas de las figuras dibujadas en un plano de coordenadas mediante la <span class="font-bold text-[#0055B2]">geometría de coordenadas</span>.'},{tid:"146",englishTerm:"Coordinate plane",englishDefinition:'The <span class="font-bold text-[#0055B2]">coordinate plane</span> is formed by two number lines, called the axes, intersecting at right angles. The x-axis is the horizontal axis and the y-axis is the vertical axis. The two axes meet at the origin, O(0, 0). The axes divide the plane into four quadrants.',spanishTerm:"Plano de coordenadas",spanishDefinition:'Se forma cuando dos rectas numéricas se cortan formando ángulos rectos en un <span class="font-bold text-[#0055B2]">plano de coordenadas</span>.'},{tid:"148",englishTerm:"Coordinate space",englishDefinition:'<span class="font-bold text-[#0055B2]">Coordinate space</span> is a three-dimensional space where each point is described uniquely using an ordered triple of numbers.',spanishTerm:"Espacio de coordenadas",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">espacio de coordenadas</span> es un espacio tridimensional en el cual cada punto es definido de manera única por una tripleta ordenada de números.'},{tid:"150",englishTerm:"Coplanar figures",englishDefinition:'<span class="font-bold text-[#0055B2]">Coplanar figures</span> are figures in the same plane.',spanishTerm:"Figuras coplanares",spanishDefinition:'Las <span class="font-bold text-[#0055B2]">figuras coplanares</span> son las figuras que están localizadas en el mismo plano.'},{tid:"151",englishTerm:"Corollary",englishDefinition:'A <span class="font-bold text-[#0055B2]">corollary</span> is a theorem that can be proved easily using another theorem.',spanishTerm:"Corolario",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">corolario</span> es un teorema que se puede probar fácilmente usando otro teorema.'},{tid:"152",englishTerm:"Correlation",englishDefinition:'A <span class="font-bold text-[#0055B2]">correlation</span> indicates the strength of a relationship between two data sets.',spanishTerm:"Correlación",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">correlación</span> indica la fuerza de una relación entre dos conjuntos de datos.'},{tid:"153",englishTerm:"Correlation coefficient",englishDefinition:'The <span class="font-bold text-[#0055B2]">correlation coefficient</span>, r, indicates the strength of the correlation. The closer r is to 1 or –1, the more closely the data resembles a line and the more accurate your model is likely to be.',spanishTerm:"Coeficiente de correlación",spanishDefinition:'El <span class="font-bold text-[#0055B2]">coeficiente de correlación</span>, r, indica la fuerza de la correlación. Mientras más cerca está r de 1 ó –1, más se parecen los datos a una línea y será más probable que tu modelo sea preciso.'},{tid:"155",englishTerm:"Corresponding elements",englishDefinition:'<span class="font-bold text-[#0055B2]">Corresponding elements</span> are elements in the same position in each matrix.',spanishTerm:"Elementos correspondientes",spanishDefinition:'Los <span class="font-bold text-[#0055B2]">elementos correspondientes</span> son elementos que se encuentran en la misma posición de cada matriz.'},{tid:"161",englishTerm:"Coterminal angles",englishDefinition:'Two angles in standard position are <span class="font-bold text-[#0055B2]">coterminal angles</span> if they have the same terminal side.',spanishTerm:"Ángulos coterminales",spanishDefinition:'Dos <span class="font-bold text-[#0055B2]">ángulos coterminales</span> que están en posición normal son aquellos que tienen el mismo lado terminal.'},{tid:"162",englishTerm:"Counterexample",englishDefinition:'An example that serves as a <span class="font-bold text-[#0055B2]">counterexample</span> by demonstrating that a statement is false.',spanishTerm:"Contraejemplo",spanishDefinition:'Ejemplo que demuestra que un enunciado es falso y que actúa como un <span class="font-bold text-[#0055B2]">contraejemplo</span>.'},{tid:"163",englishTerm:"Co-vertices",englishDefinition:'The endpoints of the minor axis of an ellipse are the <span class="font-bold text-[#0055B2]">co-vertices</span> of the ellipse.',spanishTerm:"Covértices",spanishDefinition:'Los puntos de intersección entre una elipse y el eje menor son los <span class="font-bold text-[#0055B2]">covértices</span> de la elipse.'},{tid:"166",englishTerm:"Cross Products Property",englishDefinition:'The <span class="font-bold text-[#0055B2]">cross products property</span> states that the product of the extremes of a proportion is equal to the product of the means.',spanishTerm:"Propiedad de los productos cruzados",spanishDefinition:'La <span class="font-bold text-[#0055B2]">propiedad de los productos cruzados</span> establece que el producto de los extremos de una proporción es igual al producto de los medios.'},{tid:"167",englishTerm:"Cross section",englishDefinition:'A <span class="font-bold text-[#0055B2]">cross section</span> is the intersection of a solid and a plane.',spanishTerm:"Sección de corte",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">sección de corte</span> es la intersección de un plano y un cuerpo geométrico.'},{tid:"169",englishTerm:"Cube root equation",englishDefinition:'The <span class="font-bold text-[#0055B2]">cube root equation</span> is an equation that has a variable in the radicand or has a variable with a rational exponent with a denominator of 3.',spanishTerm:"Ecuación de raíz cúbica",spanishDefinition:'La <span class="font-bold text-[#0055B2]">ecuación de raíz cúbica</span> es una ecuación que lleva una variable en el radicando o que lleva una variable con un exponente racional cuyo denominador es 3.'},{tid:"170",englishTerm:"Cube root function",englishDefinition:'A <span class="font-bold text-[#0055B2]">cube root function</span> is the inverse of a cubic function.',spanishTerm:"Función de raíz cúbica",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">función de raíz cúbica</span> es el inverso de una función cúbica.'},{tid:"172",englishTerm:"Cumulative frequency table",englishDefinition:'A <span class="font-bold text-[#0055B2]">cumulative frequency table</span> is a table that shows the number of data values that lie in or below the given intervals.',spanishTerm:"Tabla de frecuencia cumulativa",spanishDefinition:'Tabla que muestra el número de valores de datos que están dentro o por debajo de los intervalos dados en la <span class="font-bold text-[#0055B2]">tabla de frecuencia cumulativa</span>.'},{tid:"173",englishTerm:"Cumulative probability",englishDefinition:'When you can assign numerical values to events, <span class="font-bold text-[#0055B2]">cumulative probability</span> is the probability that an event with a value less than or equal to a given value occurs.',spanishTerm:"Probabilidad acumulativa",spanishDefinition:'Cuando se puede a signarasignarvalores numéricos a los eventos, la <span class="font-bold text-[#0055B2]">probabilidad acumulativa</span> es la probabilidad de que un evento con un valor que es menor que o igual a un valor dado ocurra.'},{tid:"175",englishTerm:"Cylinder",englishDefinition:'A <span class="font-bold text-[#0055B2]">cylinder</span> is a three dimensional figure with two congruent circular bases that lie in parallel planes. An altitude of a cylinder is a perpendicular segment that joins the planes of the bases. Its length is the height of the cylinder. In a right cylinder, the segment joining the centers of the bases is an altitude. In an oblique cylinder, the segment joining the centers of the bases is not perpendicular to the planes containing the bases.',spanishTerm:"Cilindro",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">cilindro</span> es una figura tridimensional con dos bases congruentes circulares en planos paralelos. Una altura de un cilindro es un segmento perpendicular que une los planos de las bases. Su longitud es, por extensión, la altura del cilindro. En un cilindro recto, el segmento que une los centros de las bases es una altura. En un cilindro oblicuo, el segmento que une los centros de las bases no es perpendicular a los planos que contienen las bases.'},{tid:"176",englishTerm:"Decagon",englishDefinition:'A <span class="font-bold text-[#0055B2]">decagon</span> is a polygon with ten sides.',spanishTerm:"Decágono",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">decágono</span> es un polígono de diez lados.'},{tid:"177",englishTerm:"Decay factor",englishDefinition:'1 minus the percent rate of change, expressed as a decimal, for an exponential decay situation, is known as the <span class="font-bold text-[#0055B2]">decay factor</span>.',spanishTerm:"Factor de decremento",spanishDefinition:'1 menos la tasa porcentual de cambio, expresada como decimal, en una situación de reducción exponencial, es el <span class="font-bold text-[#0055B2]">factor de decremento</span>.'},{tid:"178",englishTerm:"Deductive reasoning",englishDefinition:'<span class="font-bold text-[#0055B2]">Deductive reasoning</span> is a process of reasoning logically from given facts to a conclusion.',spanishTerm:"Razonamiento deductivo",spanishDefinition:'El <span class="font-bold text-[#0055B2]">razonamiento deductivo</span> es un proceso de razonamiento lógico que parte de hechos dados hasta llegar a una conclusión.'},{tid:"182",englishTerm:"Dependent events",englishDefinition:'When the outcome of one event affects the probability of a second event, the events are <span class="font-bold text-[#0055B2]">dependent events</span>.',spanishTerm:"Sucesos dependientes",spanishDefinition:'Dos <span class="font-bold text-[#0055B2]">sucesos dependientes</span> son aquellos en los que el resultado de un suceso dependiente afecta la probabilidad del otro.'},{tid:"183",englishTerm:"Dependent system",englishDefinition:'A system of equations that does not have a unique solution is a <span class="font-bold text-[#0055B2]">dependent system</span>.',spanishTerm:"Sistema dependiente",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">sistema dependiente</span> de ecuaciones es aquel que no tiene una solución única.'},{tid:"184",englishTerm:"Dependent variable",englishDefinition:'A <span class="font-bold text-[#0055B2]">dependent variable</span> is a variable that provides the output values of a function.',spanishTerm:"Variable dependiente",spanishDefinition:'<span class="font-bold text-[#0055B2]">Variable dependiente</span> es la variable de la que dependen los valores de salida de una función.'},{tid:"186",englishTerm:"Determinant",englishDefinition:'The <span class="font-bold text-[#0055B2]">determinant</span> of a square matrix is a real number that can be computed from its elements according to a specific formula.',spanishTerm:"Determinante",spanishDefinition:'El <span class="font-bold text-[#0055B2]">determinante</span> de una matriz cuadrada es un número real que se puede calcular a partir de sus elementos por medio de una fórmula específica.'},{tid:"196",englishTerm:"Directrix",englishDefinition:'The <span class="font-bold text-[#0055B2]">directrix</span> of a parabola is the fixed line used to define a parabola. Each point of the parabola is the same distance from the focus and the directrix.',spanishTerm:"Directriz",spanishDefinition:'La <span class="font-bold text-[#0055B2]">directriz</span> de una parábola es la recta fija con que se define una parábola. Cada punto de la parábola está a la misma distancia del foco y de la directriz.'},{tid:"197",englishTerm:"Discontinuous graph",englishDefinition:'A <span class="font-bold text-[#0055B2]">discontinuous graph</span> is a graph that is discontinuous if it has a jump, break, or hole.',spanishTerm:"Gráfica discontinua",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">gráfica discontinua</span> es una gráfica que tiene un salto, interrupción o hueco.'},{tid:"198",englishTerm:"Discrete graph",englishDefinition:'A <span class="font-bold text-[#0055B2]">discrete graph</span> is a graph composed of isolated points.',spanishTerm:"Gráfica discreta",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">gráfica discreta</span> es compuesta de puntos aislados.'},{tid:"199",englishTerm:"Discrete probability distribution",englishDefinition:'A <span class="font-bold text-[#0055B2]">discrete probability distribution</span> has a finite number of possible events.',spanishTerm:"Distribución de probabilidad discreta",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">distribución de probabilidad discreta</span> tiene un número finito de sucesos posibles.'},{tid:"201",englishTerm:"Disjoint sets",englishDefinition:'Sets that do not have any elements in common, are referred to as <span class="font-bold text-[#0055B2]">disjoint sets</span>.',spanishTerm:"Conjuntos ajenos",spanishDefinition:'<span class="font-bold text-[#0055B2]">Conjuntos ajenos</span> son aquellos conjuntos que no tienen elementos en común.'},{tid:"202",englishTerm:"Disjunction",englishDefinition:'A <span class="font-bold text-[#0055B2]">disjunction</span> is a compound statement formed by connecting two or more statements with the word or.',spanishTerm:"Disyunción",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">disyunción</span> es un enunciado compuesto que conecta dos o más enunciados por medio de la palabra o.'},{tid:"207",englishTerm:"Diverge",englishDefinition:'An infinite series <span class="font-bold text-[#0055B2]">diverge</span>s if it does not converge.',spanishTerm:"Divergir",spanishDefinition:'Una serie infinita diverge (es decir, <span class="font-bold text-[#0055B2]">divergir</span>) si no es convergente.'},{tid:"208",englishTerm:"Dodecagon",englishDefinition:'A <span class="font-bold text-[#0055B2]">dodecagon</span> is a polygon with 12 sides.',spanishTerm:"Dodecágono",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">dodecágono</span> es un polígono de 12 lados.'},{tid:"209",englishTerm:"Domain",englishDefinition:'The <span class="font-bold text-[#0055B2]">domain</span> of a relation is the set of all inputs, or x-coordinates, of the ordered pairs.',spanishTerm:"Dominio",spanishDefinition:'El <span class="font-bold text-[#0055B2]">dominio</span> de una relación es el conjunto de todos los valores de entrada, o coordenadas x, de los pares ordenados.'},{tid:"214",englishTerm:"Elimination method",englishDefinition:'<span class="font-bold text-[#0055B2]">Elimination method</span> is a method for solving a system of linear equations where you add or subtract the equations to eliminate a variable.',spanishTerm:"Eliminación",spanishDefinition:'Método para resolver un sistema de ecuaciones lineales mediante la <span class="font-bold text-[#0055B2]">eliminación</span> de una variable al sumar o restar las ecuaciones.'},{tid:"216",englishTerm:"Empty set",englishDefinition:'A set that does not contain any elements, is known as an <span class="font-bold text-[#0055B2]">empty set</span>.',spanishTerm:"Conjunto vacío",spanishDefinition:'<span class="font-bold text-[#0055B2]">Conjunto vacío</span> es un conjunto que no contiene elementos.'},{tid:"217",englishTerm:"End behavior",englishDefinition:'<span class="font-bold text-[#0055B2]">End behavior</span> of the graph of a function describes the directions of the graph as you move to the left and to the right, away from the origin.',spanishTerm:"Comportamiento extremo",spanishDefinition:'El <span class="font-bold text-[#0055B2]">comportamiento extremo</span> de la gráfica de una función describe las direcciones de la gráfica al moverse a la izquierda y a la derecha, apartándose del origen.'},{tid:"220",englishTerm:"Equal matrices",englishDefinition:'<span class="font-bold text-[#0055B2]">Equal matrices</span> are matrices with the same dimensions and equal corresponding elements.',spanishTerm:"Matrices equivalentes",spanishDefinition:'Dos <span class="font-bold text-[#0055B2]">matrices equivalentes</span> son equivalentes si y sólo si tienen las mismas dimensiones y sus elementos correspondientes son iguales.'},{tid:"221",englishTerm:"Equally likely outcomes",englishDefinition:'<span class="font-bold text-[#0055B2]">Equally likely outcomes</span> are events in a sample space that have the same chance of occurring.',spanishTerm:"Resultados igualmente probables",spanishDefinition:'<span class="font-bold text-[#0055B2]">Resultados igualmente probables</span> son sucesos en un espacio muestral con la misma probabilidad de ocurrir.'},{tid:"222",englishTerm:"Equation",englishDefinition:'An <span class="font-bold text-[#0055B2]">equation</span> is a statement that shows that two algebraic expressions are equal.',spanishTerm:"Ecuación",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">ecuación</span> es una expresión que muestra que dos expresiones algebraicas son iguales.'},{tid:"224",englishTerm:"Equidistant",englishDefinition:'A point is <span class="font-bold text-[#0055B2]">equidistant</span> from two objects if it is the same distance from the objects.',spanishTerm:"Equidistante",spanishDefinition:'Un punto es <span class="font-bold text-[#0055B2]">equidistante</span> de dos objetos si la distancia entre el punto y los objetos es igual.'},{tid:"226",englishTerm:"Equivalent equations",englishDefinition:'Equations that have the same solution and are therefore <span class="font-bold text-[#0055B2]">equivalent equations</span>.',spanishTerm:"Ecuaciones equivalentes",spanishDefinition:'<span class="font-bold text-[#0055B2]">Ecuaciones equivalentes</span> son aquellas ecuaciones que tienen la misma solución.'},{tid:"227",englishTerm:"Equivalent expressions",englishDefinition:'Algebraic expressions that have the same value for all values of the variable(s) are known as <span class="font-bold text-[#0055B2]">equivalent expressions</span>.',spanishTerm:"Expresiones equivalentes",spanishDefinition:'Expresiones algebraicas que tienen el mismo valor para todos los valores de la(s) variable(s) y que se consideran <span class="font-bold text-[#0055B2]">expresiones equivalentes</span>.'},{tid:"228",englishTerm:"Equivalent inequalities",englishDefinition:'Inequalities that have the same set of solutions and are considered <span class="font-bold text-[#0055B2]">equivalent inequalities</span>.',spanishTerm:"Desigualdades equivalentes",spanishDefinition:'Las <span class="font-bold text-[#0055B2]">desigualdades equivalentes</span> tienen el mismo conjunto de soluciones.'},{tid:"229",englishTerm:"Equivalent statements",englishDefinition:'<span class="font-bold text-[#0055B2]">Equivalent statements</span> are statements with the same truth value.',spanishTerm:"Enunciados equivalentes",spanishDefinition:'Los <span class="font-bold text-[#0055B2]">enunciados equivalentes</span> son enunciados con el mismo valor verdadero.'},{tid:"230",englishTerm:"Equivalent systems",englishDefinition:'<span class="font-bold text-[#0055B2]">Equivalent systems</span> are systems that have the same solution(s).',spanishTerm:"Sistemas equivalentes",spanishDefinition:'<span class="font-bold text-[#0055B2]">Sistemas equivalentes</span> son sistemas que tienen la misma solución o las mismas soluciones.'},{tid:"231",englishTerm:"Euclidean geometry",englishDefinition:'<span class="font-bold text-[#0055B2]">Euclidean geometry</span> is a geometry of the plane in which Euclid’s Parallel Postulate is accepted as true.',spanishTerm:"Geometría euclidiana",spanishDefinition:'La <span class="font-bold text-[#0055B2]">geometría euclidiana</span> es una geometría del plano en donde el postulado paralelo de Euclides es verdadero.'},{tid:"232",englishTerm:"Evaluate",englishDefinition:'To <span class="font-bold text-[#0055B2]">evaluate</span> means to substitute a given number for each variable, and then simplify.',spanishTerm:"Evaluar",spanishDefinition:'Método de sustituir cada variable por un número dado para luego simplificar la expresión mediante la acción de <span class="font-bold text-[#0055B2]">evaluar</span>.'},{tid:"236",englishTerm:"Expand",englishDefinition:'To <span class="font-bold text-[#0055B2]">expand</span> the power of a binomial, multiply as needed, then write the polynomial in standard form.',spanishTerm:"Expandir",spanishDefinition:'Para <span class="font-bold text-[#0055B2]">expandir</span> la potencia de un binomio, multiplica como sea necesario. Luego, escribe el polinomio en forma normal.'},{tid:"237",englishTerm:"Expected value",englishDefinition:`The average value you can expect for a large number of trials of an experiment; the sum of each outcome's value multiplied by its probability, known as the <span class="font-bold text-[#0055B2]">expected value</span>.`,spanishTerm:"Valor esperado",spanishDefinition:'El <span class="font-bold text-[#0055B2]">valor esperado</span> es el valor promedio que se puede esperar para una cantidad grande de pruebas en un experimento; la suma de los valores de los resultados multiplicados cada uno por su probabilidad.'},{tid:"239",englishTerm:"Experimental group",englishDefinition:'In an experiment, the group chosen to receive the treatment is the <span class="font-bold text-[#0055B2]">experimental group</span>.',spanishTerm:"Grupo experimental",spanishDefinition:'En un experimento, el grupo manipulado es el <span class="font-bold text-[#0055B2]">grupo experimental</span>.'},{tid:"241",englishTerm:"Explicit definition",englishDefinition:'An <span class="font-bold text-[#0055B2]">explicit definition</span> allows any term in a sequence to be found without knowing the previous term.',spanishTerm:"Definición explícita",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">definición explícita</span> permite hallar cualquier término de una progresión aunque no se conozca el término anterior.'},{tid:"242",englishTerm:"Explicit formula",englishDefinition:'An <span class="font-bold text-[#0055B2]">explicit formula</span> expresses the nth term of a sequence in terms of n.',spanishTerm:"Fórmula explícita",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">fórmula explícita</span> expresa el n-ésimo término de una progresión en función de n.'},{tid:"243",englishTerm:"Exponent",englishDefinition:'A number that shows repeated multiplication, is referred to as an <span class="font-bold text-[#0055B2]">exponent</span>.',spanishTerm:"Exponente",spanishDefinition:'Denota el número de veces que el <span class="font-bold text-[#0055B2]">exponente</span> debe multiplicarse.'},{tid:"252",englishTerm:"Extraneous solution",englishDefinition:'An <span class="font-bold text-[#0055B2]">extraneous solution</span> is a solution of an equation derived from an original equation that is not a solution of the original equation.',spanishTerm:"Solución extraña",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">solución extraña</span> es una solución de una ecuación derivada que no es una solución de la ecuación original.'},{tid:"253",englishTerm:"Extrapolation",englishDefinition:'The process of predicting a value outside the range of known values through <span class="font-bold text-[#0055B2]">extrapolation</span>.',spanishTerm:"Extrapolación",spanishDefinition:'Proceso que se usa en la <span class="font-bold text-[#0055B2]">extrapolación</span> para predecir un valor por fuera del ámbito de los valores dados.'},{tid:"256",englishTerm:"Factor by grouping",englishDefinition:'A method of factoring that uses the distributive property to remove a common binomial factor of two pairs of terms through the process of <span class="font-bold text-[#0055B2]">factor by grouping</span>.',spanishTerm:"Factor común por agrupación de términos",spanishDefinition:'Método de factorización que aplica la propiedad distributiva para sacar un <span class="font-bold text-[#0055B2]">factor común por agrupación de términos</span> de dos pares de términos en un binomio.'},{tid:"258",englishTerm:"Factoring",englishDefinition:'<span class="font-bold text-[#0055B2]">Factoring</span> is rewriting an expression as the product of its factors.',spanishTerm:"Descomposición factorial",spanishDefinition:'Descomponer en factores es el proceso de escribir de nuevo una expresión como el producto de sus factores mediante la <span class="font-bold text-[#0055B2]">descomposición factorial</span>.'},{tid:"260",englishTerm:"Family of functions",englishDefinition:'A <span class="font-bold text-[#0055B2]">family of functions</span> is a group of functions that use the same common operation in their equation forms.',spanishTerm:"Familia de funciones",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">familia de funciones</span> es un grupo de funciones que usan la misma operación común en su forma de ecuación.'},{tid:"261",englishTerm:"Feasible region",englishDefinition:'In a linear programming problem, the <span class="font-bold text-[#0055B2]">feasible region</span> contains all the values that satisfy the constraints on the objective function.',spanishTerm:"Región factible",spanishDefinition:'En un problema de programación lineal, la <span class="font-bold text-[#0055B2]">región factible</span> contiene todos los valores que satisfacen las restricciones de la función objetiva.'},{tid:"262",englishTerm:"Fibonacci Sequence",englishDefinition:'The <span class="font-bold text-[#0055B2]">Fibonacci sequence</span> is the infinite sequence of numbers beginning with 1, 1, . . . such that each term is the sum of the two previous terms.',spanishTerm:"Sucesión de Fibonacci",spanishDefinition:'La <span class="font-bold text-[#0055B2]">sucesión de Fibonacci</span> es la sucesión infinita de números que comienza con 1, 1, . . . de forma tal que cada término es la suma de los dos términos anteriores.'},{tid:"263",englishTerm:"Finite series",englishDefinition:'A <span class="font-bold text-[#0055B2]">finite series</span> is a series with a finite number of terms.',spanishTerm:"Serie finita",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">serie finita</span> es una serie con un número finito de términos.'},{tid:"264",englishTerm:"Floor function",englishDefinition:'The <span class="font-bold text-[#0055B2]">floor function</span> rounds numbers down to the nearest integer.',spanishTerm:"Función piso",spanishDefinition:'La <span class="font-bold text-[#0055B2]">función piso</span> redondea los números hacia abajo al entero más cercano.'},{tid:"266",englishTerm:"Focal length",englishDefinition:'The <span class="font-bold text-[#0055B2]">focal length</span> of a parabola is the distance between the vertex and the focus.',spanishTerm:"Distancia focal",spanishDefinition:'La <span class="font-bold text-[#0055B2]">distancia focal</span> de una parábola es la distancia entre el vértice y el foco.'},{tid:"270",englishTerm:"Formula",englishDefinition:'A <span class="font-bold text-[#0055B2]">formula</span> is an equation that states a relationship among quantities.',spanishTerm:"Fórmula",spanishDefinition:'Ecuación que establece una relación entre cantidades mediante una <span class="font-bold text-[#0055B2]">fórmula</span>.'},{tid:"272",englishTerm:"Frequency table",englishDefinition:'A <span class="font-bold text-[#0055B2]">frequency table</span> is a table that groups a set of data values into intervals and shows the frequency for each interval.',spanishTerm:"Tabla de frecuencias",spanishDefinition:'<span class="font-bold text-[#0055B2]">Tabla de frecuencias</span> que agrupa un conjunto de datos en intervalos y muestra la frecuencia de cada intervalo.'},{tid:"273",englishTerm:"Function",englishDefinition:'A <span class="font-bold text-[#0055B2]">function</span> is a relation in which each element of the domain corresponds with exactly one element in the range.',spanishTerm:"Función",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">función</span> es una relación en la que cada elemento del dominio corresponde exactamente con un elemento del rango.'},{tid:"275",englishTerm:"Function rule",englishDefinition:'A <span class="font-bold text-[#0055B2]">function rule</span> represents an output value in terms of an input value.',spanishTerm:"Regla de función",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">regla de función</span> representa un valor de salida en función a un valor de entrada.'},{tid:"276",englishTerm:"Fundamental Counting Principle",englishDefinition:'The <span class="font-bold text-[#0055B2]">fundamental counting principle</span> states that if there are m ways to make the first selection and n ways to make the second selection, then there are m ∙ n ways to make the two selections according to the fundamental counting principle.',spanishTerm:"Principio básico de conteo",spanishDefinition:'El <span class="font-bold text-[#0055B2]">principio básico de conteo</span> es una herramienta que se puede utilizar para hacer un conteo rápido del número de formas en que pueden ocurrir ciertas cosas.'},{tid:"278",englishTerm:"Gaussian elimination",englishDefinition:'The process of using row operations on a matrix that represents a system of equations in order to solve the system using <span class="font-bold text-[#0055B2]">gaussian elimination</span>.',spanishTerm:"Eliminación gaussiana",spanishDefinition:'El proceso de usar operaciones de fila en una matriz que representa un sistema de ecuaciones para resolver el sistema mediante la <span class="font-bold text-[#0055B2]">eliminación gaussiana</span>.'},{tid:"282",englishTerm:"Geometric probability",englishDefinition:'<span class="font-bold text-[#0055B2]">Geometric probability</span> is a probability that uses a geometric model in which points represent outcomes.',spanishTerm:"Probabilidad geométrica",spanishDefinition:'La <span class="font-bold text-[#0055B2]">probabilidad geométrica</span> es una probabilidad que utiliza un modelo geométrico donde se usan puntos para representar resultados.'},{tid:"283",englishTerm:"Geometric sequence",englishDefinition:'A <span class="font-bold text-[#0055B2]">geometric sequence</span> is a number sequence formed by multiplying a term in the sequence by a fixed number to find the next term.',spanishTerm:"Progresión geométrica",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">progresión geométrica</span> es una progresión con una razón constante entre términos consecutivos.'},{tid:"284",englishTerm:"Geometric series",englishDefinition:'A <span class="font-bold text-[#0055B2]">geometric series</span> is the sum of the terms in a geometric sequence.',spanishTerm:"Serie geométrica",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">serie geométrica</span> es la suma de términos en una progresión geométrica.'},{tid:"285",englishTerm:"Glide reflection",englishDefinition:'A <span class="font-bold text-[#0055B2]">glide reflection</span> is the composition of a reflection followed by a translation in a direction parallel to the line of reflection.',spanishTerm:"Reflexión deslizada",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">reflexión deslizada</span> es la composición de una traslación seguida por una reflexión a través de una línea paralela a la dirección de traslación.'},{tid:"287",englishTerm:"Great circle",englishDefinition:'A <span class="font-bold text-[#0055B2]">great circle</span> is the intersection of a sphere and a plane containing the center of the sphere. A great circle divides a sphere into two hemispheres.',spanishTerm:"Círculo máximo",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">círculo máximo</span> es la intersección de una esfera y un plano que contiene el centro de la esfera. Un círculo máximo divide una esfera en dos hemisferios.'},{tid:"288",englishTerm:"Greatest common factor",englishDefinition:'The <span class="font-bold text-[#0055B2]">greatest common factor</span> (GCF) of an expression is the common factor of each term of the expression that has the greatest coefficient and the greatest exponent.',spanishTerm:"Máximo factor común",spanishDefinition:'El <span class="font-bold text-[#0055B2]">máximo factor común</span> de una expresión es el factor común de cada término de la expresión que tiene el mayor coeficiente y el mayor exponente.'},{tid:"289",englishTerm:"Greatest integer function",englishDefinition:'The <span class="font-bold text-[#0055B2]">greatest integer function</span> corresponds each input x to the greatest integer less than or equal to x.',spanishTerm:"Función del entero mayor",spanishDefinition:'La <span class="font-bold text-[#0055B2]">función del entero mayor</span> relaciona cada entrada x con el entero mayor que es menor o igual a x.'},{tid:"290",englishTerm:"Growth factor",englishDefinition:'In an exponential function of the form y = ab^x , b is the <span class="font-bold text-[#0055B2]">growth factor</span> if b > 1.',spanishTerm:"Factor incremental",spanishDefinition:'1 más la tasa porcentual de cambio en una situación de incremento exponencial que se utiliza para calcular el <span class="font-bold text-[#0055B2]">factor incremental</span>.'},{tid:"291",englishTerm:"Half-plane",englishDefinition:'A <span class="font-bold text-[#0055B2]">half-plane</span> is the set of points in a coordinate plane that are on one side of the boundary of the graph of a linear inequality.',spanishTerm:"Semiplano",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">semiplano</span> es el conjunto de puntos de un plano de coordenadas que están a un lado del límite de la gráfica de desigualdad lineal.'},{tid:"294",englishTerm:"Heron's formula",englishDefinition:`<span class="font-bold text-[#0055B2]">Heron's formula</span> is a formula for finding the area of a triangle given the lengths of its sides.`,spanishTerm:"Fórmula de Herón",spanishDefinition:'La <span class="font-bold text-[#0055B2]">fórmula de Herón</span> se usa para hallar el área de un triángulo, dadas las longitudes de sus lados.'},{tid:"295",englishTerm:"Hexagon",englishDefinition:'A <span class="font-bold text-[#0055B2]">hexagon</span> is a polygon with six sides.',spanishTerm:"Hexágono",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">hexágono</span> es un polígono de seis lados.'},{tid:"296",englishTerm:"Histogram",englishDefinition:'A special type of bar graph known as a <span class="font-bold text-[#0055B2]">histogram</span> can display data from a frequency table. Each bar in the histogram represents an interval, and the height of each bar shows the frequency of the interval it represents.',spanishTerm:"Histograma",spanishDefinition:'Tipo de gráfica de barras que muestra los datos de una tabla de frecuencia. Cada barra en el <span class="font-bold text-[#0055B2]">histograma</span> representa un intervalo. La altura de cada barra del histograma muestra la frecuencia del intervalo al que representa.'},{tid:"299",englishTerm:"Hypothesis",englishDefinition:'In an if-then statement (conditional) the <span class="font-bold text-[#0055B2]">hypothesis</span> is the part that follows if.',spanishTerm:"Hipótesis",spanishDefinition:'En un enunciado si . . . entonces . . . (condicional), la <span class="font-bold text-[#0055B2]">hipótesis</span> es la parte del enunciado que sigue el si.'},{tid:"301",englishTerm:"Identity",englishDefinition:'An <span class="font-bold text-[#0055B2]">identity</span> is an equation between two polynomial expressions in which one side can be transformed into the other side using defined rules of calculation.',spanishTerm:"Identidad",spanishDefinition:'Una ecuación que es verdadera para todos los valores de la <span class="font-bold text-[#0055B2]">identidad</span>.'},{tid:"302",englishTerm:"Identity matrix",englishDefinition:'An <span class="font-bold text-[#0055B2]">identity matrix</span> is a matrix I such that IB = BI =B; it is a square matrix with 1s along the main diagonal and 0 for all of the other elements.',spanishTerm:"Matriz de identidad",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">matriz de identidad</span> es una matriz I tal que IB = BI = B</i.>; una matriz cuadrada con unos por la diagonal principal y ceros en los demás elementos.'},{tid:"304",englishTerm:"Imaginary axis",englishDefinition:'The vertical axis in the complex plane is the <span class="font-bold text-[#0055B2]">imaginary axis</span>.',spanishTerm:"Eje imaginario",spanishDefinition:'El eje vertical en el plano complejo es el <span class="font-bold text-[#0055B2]">eje imaginario</span>.'},{tid:"306",englishTerm:"Imaginary unit",englishDefinition:'The <span class="font-bold text-[#0055B2]">imaginary unit</span> i is the complex number whose square is –1.',spanishTerm:"Unidad imaginaria",spanishDefinition:'La <span class="font-bold text-[#0055B2]">unidad imaginaria</span> i es el número complejo cuyo cuadrado es –1.'},{tid:"308",englishTerm:"Inconsistent system",englishDefinition:'A system of equations that has no solution is an <span class="font-bold text-[#0055B2]">inconsistent system</span>.',spanishTerm:"Sistema incompatible",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">sistema incompatible</span> es un sistema de ecuaciones para el cual no hay solución.'},{tid:"309",englishTerm:"Independent events",englishDefinition:'When the outcome of one event does not affect the probability of a second event, the two events are <span class="font-bold text-[#0055B2]">independent events</span>.',spanishTerm:"Sucesos independientes",spanishDefinition:'Cuando el resultado de un suceso no altera la probabilidad de otro, los dos sucesos son <span class="font-bold text-[#0055B2]">sucesos independientes</span>.'},{tid:"310",englishTerm:"Independent system",englishDefinition:'A system of linear equations that has a unique solution is an <span class="font-bold text-[#0055B2]">independent system</span>.',spanishTerm:"Sistema independiente",spanishDefinition:'Un sistema de ecuaciones lineales que tenga una sola solución es un <span class="font-bold text-[#0055B2]">sistema independiente</span>.'},{tid:"311",englishTerm:"Independent variable",englishDefinition:'A variable that provides the input values of a function known as an <span class="font-bold text-[#0055B2]">independent variable</span>.',spanishTerm:"Variable independiente",spanishDefinition:'<span class="font-bold text-[#0055B2]">Variable independiente</span> de la que dependen los valores de entrada de una función.'},{tid:"312",englishTerm:"Index",englishDefinition:'With a radical sign, the <span class="font-bold text-[#0055B2]">index</span> indicates the degree of the root.',spanishTerm:"Índice",spanishDefinition:'Con un signo de radical, el <span class="font-bold text-[#0055B2]">índice</span> indica el grado de la raíz.'},{tid:"313",englishTerm:"Indirect measurement",englishDefinition:'<span class="font-bold text-[#0055B2]">Indirect measurement</span> is a way of measuring things that are difficult to measure directly.',spanishTerm:"Medición indirecta",spanishDefinition:'La <span class="font-bold text-[#0055B2]">medición indirecta</span> es un modo de medir cosas difíciles de medir directamente.'},{tid:"315",englishTerm:"Indirect reasoning",englishDefinition:'<span class="font-bold text-[#0055B2]">Indirect reasoning</span> is a type of reasoning in which all possibilities are considered and then all but one are proved false. The remaining possibility must be true.',spanishTerm:"Razonamiento indirecto",spanishDefinition:'<span class="font-bold text-[#0055B2]">Razonamiento indirecto</span> es un tipo de razonamiento en el que se consideran todas las posibilidades y se prueba que todas son falsas, a excepción de una. La posibilidad restante debe ser verdadera.'},{tid:"316",englishTerm:"Inductive reasoning",englishDefinition:'<span class="font-bold text-[#0055B2]">Inductive reasoning</span> is a type of reasoning that reaches conclusions based on a pattern of specific examples or past events.',spanishTerm:"Razonamiento inductivo",spanishDefinition:'El <span class="font-bold text-[#0055B2]">razonamiento inductivo</span> es un tipo de razonamiento en el cual se llega a conclusiones con base en un patrón de ejemplos específicos o sucesos pasados.'},{tid:"317",englishTerm:"Inequality",englishDefinition:'A mathematical sentence that compares the values of two expressions using an <span class="font-bold text-[#0055B2]">inequality</span> symbol.',spanishTerm:"Desigualdad",spanishDefinition:'Expresión matemática que compara el valor de dos expresiones con el símbolo de <span class="font-bold text-[#0055B2]">desigualdad</span>.'},{tid:"318",englishTerm:"Infinite series",englishDefinition:'An <span class="font-bold text-[#0055B2]">infinite series</span> is a series with infinitely many terms.',spanishTerm:"Serie infinita",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">serie infinita</span> es una serie con un número infinito de términos.'},{tid:"319",englishTerm:"Initial point",englishDefinition:'The <span class="font-bold text-[#0055B2]">initial point</span> of a vector is the endpoint (not the tip) of a vector arrow.',spanishTerm:"Punto de inicio",spanishDefinition:'El <span class="font-bold text-[#0055B2]">punto de inicio</span> de un vector es el extremo (no la punta) de una flecha vectorial.'},{tid:"320",englishTerm:"Initial side",englishDefinition:'When an angle is in standard position, the <span class="font-bold text-[#0055B2]">initial side</span> of the angle is given to be on the positive x-axis. The other ray is the terminal side of the angle.',spanishTerm:"Lado inicial",spanishDefinition:'Cuando un ángulo está en posición normal, el <span class="font-bold text-[#0055B2]">lado inicial</span> del ángulo se ubica en el eje positivo de las x. El otro rayo, o semirrecta, forma el lado terminal del ángulo.'},{tid:"322",englishTerm:"Inscribed angle",englishDefinition:'An <span class="font-bold text-[#0055B2]">inscribed angle</span> is an angle in a circle if the vertex of the angle is on the circle and the sides of the angle are chords of the circle.',spanishTerm:"Ángulo inscrito",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">ángulo inscrito</span> está en un círculo si el vértice del ángulo inscrito está en el círculo y los lados del ángulo inscrito son cuerdas del círculo.'},{tid:"323",englishTerm:"Inscribed in",englishDefinition:'A circle is <span class="font-bold text-[#0055B2]">inscribed in</span> a polygon if the sides of the polygon are tangent to the circle. A polygon is inscribed in a circle if the vertices of the polygon are on the circle.',spanishTerm:"Inscrito en",spanishDefinition:'Un círculo está <span class="font-bold text-[#0055B2]">inscrito en</span> un polígono si los lados del polígono son tangentes al círculo. Un polígono está inscrito en un círculo si los vértices del polígono están en el círculo.'},{tid:"324",englishTerm:"Integers",englishDefinition:'Whole numbers and their opposites are called <span class="font-bold text-[#0055B2]">integers</span>.',spanishTerm:"Números enteros",spanishDefinition:'<span class="font-bold text-[#0055B2]">Números enteros</span> que constan exclusivamente de una o más unidades, y sus opuestos.'},{tid:"325",englishTerm:"Intercepted arc",englishDefinition:'An <span class="font-bold text-[#0055B2]">intercepted arc</span> is an arc of a circle having endpoints on the sides of an inscribed angle, and its other points in the interior of the angle.',spanishTerm:"Arco interceptor",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">arco interceptor</span> es un arco de un círculo cuyos extremos están en los lados de un ángulo inscrito y los punto restantes están en el interior del ángulo'},{tid:"326",englishTerm:"Interpolation",englishDefinition:'The process of estimating a value through <span class="font-bold text-[#0055B2]">interpolation</span> between two known quantities.',spanishTerm:"Interpolación",spanishDefinition:'Proceso que se usa para estimar el valor de una <span class="font-bold text-[#0055B2]">interpolación</span> entre dos cantidades dadas.'},{tid:"327",englishTerm:"Interquartile range",englishDefinition:'The <span class="font-bold text-[#0055B2]">interquartile range</span> of a set of data is the difference between the third and first quartiles.',spanishTerm:"Intervalo intercuartil",spanishDefinition:'El <span class="font-bold text-[#0055B2]">intervalo intercuartil</span> de un conjunto de datos es la diferencia entre el tercero y el primer cuartiles.'},{tid:"328",englishTerm:"Intersection",englishDefinition:'The <span class="font-bold text-[#0055B2]">intersection</span> is the set of elements that are common to two or more sets.',spanishTerm:"Intersección",spanishDefinition:'El conjunto de elementos que son comunes a dos o más conjuntos en la <span class="font-bold text-[#0055B2]">intersección</span>.'},{tid:"330",englishTerm:"Interval notation",englishDefinition:'A notation for describing an interval on a number line, specifies the interval’s endpoint(s) and uses a parenthesis or bracket in <span class="font-bold text-[#0055B2]">interval notation</span> to indicate whether each endpoint is included in the interval.',spanishTerm:"Notación de intervalo",spanishDefinition:'<span class="font-bold text-[#0055B2]">Notación de intervalo</span> que describe un intervalo en una recta numérica. Los extremos del intervalo se incluyen y se usa un paréntesis o corchete para indicar si cada extremo está incluido en el intervalo.'},{tid:"333",englishTerm:"Inverse matrix",englishDefinition:'An <span class="font-bold text-[#0055B2]">inverse matrix</span> is a matrix such that its product with another matrix yields the identity matrix.',spanishTerm:"Matriz inversa",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">matriz inversa</span> es una matriz tal que su producto con otra matriz da la matriz de identidad.'},{tid:"334",englishTerm:"Inverse operations",englishDefinition:'Operations that undo one another, are called <span class="font-bold text-[#0055B2]">inverse operations</span>.',spanishTerm:"Operaciones inversas",spanishDefinition:'Las <span class="font-bold text-[#0055B2]">operaciones inversas</span> son las que se cancelan una a la otra.'},{tid:"337",englishTerm:"Irrational number",englishDefinition:'A number that cannot be written as a ratio of two integers. <span class="font-bold text-[#0055B2]">Irrational number</span>s in decimal form are nonterminating and nonrepeating.',spanishTerm:"Número irracional",spanishDefinition:'<span class="font-bold text-[#0055B2]">Número irracional</span> que no puede expresarse como razón de dos números enteros. Los números irracionales en forma decimal no tienen término y no se repiten.'},{tid:"338",englishTerm:"Isolate",englishDefinition:'<span class="font-bold text-[#0055B2]">Isolate</span> refers to using properties of equality and inverse operations to get a variable with a coefficient of 1 alone on one side of the equation.',spanishTerm:"Aislar",spanishDefinition:'Usar propiedades de igualdad y operaciones inversas para poner una variable con un coeficiente de 1 sola a un lado de la ecuación, <span class="font-bold text-[#0055B2]">aislar</span>.'},{tid:"339",englishTerm:"Isometric drawing",englishDefinition:'An <span class="font-bold text-[#0055B2]">isometric drawing</span> shows a corner view of a three-dimensional figure. It is usually drawn on isometric dot paper. An isometric drawing allows you to see the top, front, and side of an object in the same drawing.',spanishTerm:"Dibujo isométrico",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">dibujo isométrico</span> muestra la perspectiva de una esquina de una figura tridimensional. Generalmente se dibuja en papel punteado isométrico. Un dibujo isométrico permite ver la cima, el frente, y el lado de un objeto en el mismo dibujo.'},{tid:"340",englishTerm:"Isometry",englishDefinition:'An <span class="font-bold text-[#0055B2]">isometry</span>, also known as a congruence transformation, is a transformation in which an original figure and its image are congruent.',spanishTerm:"Isometría",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">isometría</span>, conocida también como una transformación de congruencia, es una transformación en donde una figura original y su imagen son congruentes.'},{tid:"341",englishTerm:"Isosceles trapezoid",englishDefinition:'An <span class="font-bold text-[#0055B2]">isosceles trapezoid</span> is a trapezoid whose nonparallel opposite sides are congruent.',spanishTerm:"Trapecio isósceles",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">trapecio isósceles</span> es un trapecio cuyos lados opuestos no paralelos son congruentes.'},{tid:"342",englishTerm:"Isosceles triangle",englishDefinition:'An <span class="font-bold text-[#0055B2]">isosceles triangle</span> is a triangle that has at least two congruent sides. If there are two congruent sides, they are called legs. The vertex angle is between them. The third side is called the base and the other two angles are called the base angles.',spanishTerm:"Triángulo isósceles",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">triángulo isósceles</span> es un triángulo que tiene por lo menos dos lados congruentes. Si tiene dos lados congruentes, éstos se llaman catetos. Entre ellos se encuentra el ángulo del vértice. El tercer lado se llama base y los otros dos ángulos se llaman ángulos de base.'},{tid:"343",englishTerm:"Joint frequency",englishDefinition:'A <span class="font-bold text-[#0055B2]">joint frequency</span> is an entry in the body of a two-way frequency table.',spanishTerm:"Frecuencia conjunta",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">frecuencia conjunta</span> es una entrada en el cuerpo de una tabla de frecuencias de doble entrada.'},{tid:"344",englishTerm:"Joint relative frequency",englishDefinition:'A <span class="font-bold text-[#0055B2]">joint relative frequency</span> is a joint frequency in a two-way frequency table divided by the grand total of the entries in the table. It is also an entry in the body of a two-way relative frequency table.',spanishTerm:"Frecuencia relativa conjunta",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">frecuencia relativa conjunta</span> es una frecuencia conjunta en una tabla de frecuencias de doble entrada dividida por el total de las entradas de la tabla. Es también una entrada en el cuerpo de una tabla de frecuencias relativas de doble entrada.'},{tid:"345",englishTerm:"Joint variation",englishDefinition:'A <span class="font-bold text-[#0055B2]">joint variation</span> is a relation in which one variable varies directly with respect to each of two or more variables.',spanishTerm:"Variación conjunta",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">variación conjunta</span> es una relación en la cual el valor de una variable varía directamente con respecto a cada una de dos o más variables.'},{tid:"346",englishTerm:"Kite",englishDefinition:'A <span class="font-bold text-[#0055B2]">kite</span> is a quadrilateral with two pairs of consecutive sides congruent and no opposite sides congruent.',spanishTerm:"Cometa",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">cometa</span> es un cuadrilátero con dos pares de lados congruentes consecutivos y sin lados opuestos congruentes.'},{tid:"347",englishTerm:"Lateral area",englishDefinition:'The <span class="font-bold text-[#0055B2]">lateral area</span> of a prism or pyramid is the sum of the areas of the lateral faces. The lateral area of a cylinder or cone is the area of the curved surface.',spanishTerm:"Área lateral",spanishDefinition:'El <span class="font-bold text-[#0055B2]">área lateral</span> de un prisma o pirámide es la suma de las áreas de sus caras laterals. El área lateral de un cilindro o de un cono es el área de la superficie curvada.'},{tid:"350",englishTerm:"Law of Detachment",englishDefinition:'A law of deductive reasoning known as the <span class="font-bold text-[#0055B2]">law of detachment</span> allows you to state a conclusion is true if the hypothesis of a true conditional is true.',spanishTerm:"Ley de separación",spanishDefinition:'Ley del razonamiento deductivo que permite establecer que una conclusión es verdadera si la hipótesis de un enunciado condicional verdadero es verdadera, de acuerdo con la <span class="font-bold text-[#0055B2]">ley de separación</span>.'},{tid:"352",englishTerm:"Law of Syllogism",englishDefinition:'A law of deductive reasoning known as the <span class="font-bold text-[#0055B2]">law of syllogism</span> allows you to state a conclusion from two true conditional statements when the conclusion of one statement is the hypothesis of the other statement.',spanishTerm:"Ley del silogismo",spanishDefinition:'<span class="font-bold text-[#0055B2]">Ley del silogismo</span> es la ley del razonamiento deductivo que permite establecer una conclusión a partir de dos enunciados condicionales verdaderos cuando la conclusión de uno de los enunciados es la hipótesis del otro.'},{tid:"353",englishTerm:"Leading coefficient",englishDefinition:'In a polynomial, the non-zero term that is multiplied by the greatest power of x is the <span class="font-bold text-[#0055B2]">leading coefficient</span>.',spanishTerm:"Coeficiente principal",spanishDefinition:'En un polinomio, el término distinto de cero que se multiplica por la potencia de x mayor es el <span class="font-bold text-[#0055B2]">coeficiente principal</span>.'},{tid:"355",englishTerm:"Like radicals",englishDefinition:'<span class="font-bold text-[#0055B2]">Like radicals</span> are the radical expressions that have the same radicands.',spanishTerm:"Radicales semejantes",spanishDefinition:'Expresiones radicales que son <span class="font-bold text-[#0055B2]">radicales semejantes</span> si tienen los mismos radicandos.'},{tid:"356",englishTerm:"Like terms",englishDefinition:'Terms with exactly the same variable factors in a variable expression are called <span class="font-bold text-[#0055B2]">like terms</span>.',spanishTerm:"Términos semejantes",spanishDefinition:'<span class="font-bold text-[#0055B2]">Términos semejantes</span> son aquellos que tienen los mismos factores variables en una expresión variable.'},{tid:"363",englishTerm:"Line plot",englishDefinition:`A <span class="font-bold text-[#0055B2]">line plot</span> is a graph that shows the shape of a data set by stacking X's above each data value on a number line.`,spanishTerm:"Diagrama de puntos",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">diagrama de puntos</span>isesuna gráfica que muestra la forma de un conjunto de datos agrupando X sobre cada valor de una recta numérica.'},{tid:"368",englishTerm:"Linear function",englishDefinition:'A function whose graph is a line is a <span class="font-bold text-[#0055B2]">linear function</span>. You can represent a linear function with a linear equation.',spanishTerm:"Función lineal",spanishDefinition:'Una función cuya gráfica es una recta es una <span class="font-bold text-[#0055B2]">función lineal</span>. La función lineal se representa con una ecuación lineal.'},{tid:"369",englishTerm:"Linear inequality",englishDefinition:'An inequality in two variables whose graph is a region of the coordinate plane that is bounded by a line. Each point in the region is a solution of the <span class="font-bold text-[#0055B2]">linear inequality</span>.',spanishTerm:"Desigualdad lineal",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">desigualdad lineal</span> de dos variables cuya gráfica es una región del plano de coordenadas delimitado por una recta. Cada punto de la región es una solución de la desigualdad lineal.'},{tid:"370",englishTerm:"Linear pair",englishDefinition:'A <span class="font-bold text-[#0055B2]">linear pair</span> is a pair of adjacent angles whose noncommon sides are opposite rays.',spanishTerm:"Par lineal",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">par lineal</span> es un par de ángulos adjuntos cuyos lados no comunes son semirrectas opuestas.'},{tid:"371",englishTerm:"Linear parent function",englishDefinition:'The simplest form of a linear function known as the <span class="font-bold text-[#0055B2]">linear parent function</span>.',spanishTerm:"Función lineal elemental",spanishDefinition:'La forma más simple de una <span class="font-bold text-[#0055B2]">función lineal elemental</span>.'},{tid:"372",englishTerm:"Linear programming",englishDefinition:'<span class="font-bold text-[#0055B2]">Linear programming</span> is a method for finding a minimum or maximum value of some quantity, given a set of constraints.',spanishTerm:"Programación lineal",spanishDefinition:'<span class="font-bold text-[#0055B2]">Programación lineal</span> es un método para hallar el valor mínimo y máximo de una cantidad que se expresa como un conjunto de limitaciones.'},{tid:"373",englishTerm:"Linear-quadratic system",englishDefinition:'A <span class="font-bold text-[#0055B2]">linear-quadratic system</span> is a system of equations that includes a linear equation and a quadratic equation and is represented on a graph by the corresponding line and parabola.',spanishTerm:"Sistema cuadrático lineal",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">sistema cuadrático lineal</span> de ecuaciones que incluye una ecuación lineal y una ecuación cuadrática y se representa en una gráfica con su línea y su parábola correspondientes.'},{tid:"374",englishTerm:"Linear regression",englishDefinition:'A method used to calculate the line of best fit using <span class="font-bold text-[#0055B2]">linear regression</span> techniques.',spanishTerm:"Regresión lineal",spanishDefinition:'Método que se utiliza para calcular la línea de mejor ajuste en la <span class="font-bold text-[#0055B2]">regresión lineal</span>.'},{tid:"375",englishTerm:"Linear system",englishDefinition:'A <span class="font-bold text-[#0055B2]">linear system</span> is a set of two or more linear equations that use the same variables.',spanishTerm:"Sistema lineal",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">sistema lineal</span> es un conjunto de dos o más ecuaciones lineales con las mismas variables.'},{tid:"376",englishTerm:"Literal equation",englishDefinition:'An equation involving two or more variables, which is expressed in a <span class="font-bold text-[#0055B2]">literal equation</span> form.',spanishTerm:"Ecuación literal",spanishDefinition:'<span class="font-bold text-[#0055B2]">Ecuación literal</span> que incluye dos o más variables.'},{tid:"377",englishTerm:"Locus",englishDefinition:'A <span class="font-bold text-[#0055B2]">locus</span> is a set of points, all of which meet a stated condition.',spanishTerm:"Lugar geométrico",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">lugar geométrico</span> es un conjunto de puntos que cumplen una condición dada.'},{tid:"379",englishTerm:"Logarithmic equation",englishDefinition:'A <span class="font-bold text-[#0055B2]">logarithmic equation</span> is an equation that includes a logarithm involving a variable.',spanishTerm:"Ecuación logarítmica",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">ecuación logarítmica</span> es una ecuación que incluye un logaritmo con una variable.'},{tid:"380",englishTerm:"Logarithmic function",englishDefinition:'A <span class="font-bold text-[#0055B2]">logarithmic function</span> is the inverse of an exponential function.',spanishTerm:"Función logarítmica",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">función logarítmica</span> es la inversa de una función exponencial.'},{tid:"382",englishTerm:"Logarithmic scale",englishDefinition:'A <span class="font-bold text-[#0055B2]">logarithmic scale</span> is a scale that uses the logarithm of a quantity instead of the quantity itself.',spanishTerm:"Escala logarítmica",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">escala logarítmica</span> es una escala que usa el logaritmo de una cantidad en vez de la cantidad misma.'},{tid:"383",englishTerm:"Magnitude",englishDefinition:'The <span class="font-bold text-[#0055B2]">magnitude</span> of a vector <b>v</b> is the length of the arrow.',spanishTerm:"Magnitud",spanishDefinition:'La <span class="font-bold text-[#0055B2]">magnitud</span> de un vector <b>v</b> es la longitud de la flecha.'},{tid:"384",englishTerm:"Major arc",englishDefinition:'A <span class="font-bold text-[#0055B2]">major arc</span> of a circle is an arc that is larger than a semicircle.',spanishTerm:"Arco mayor",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">arco mayor</span> de un círculo es cualquier arco más grande que un semicírculo.'},{tid:"385",englishTerm:"Major axis",englishDefinition:'The <span class="font-bold text-[#0055B2]">major axis</span> of an ellipse is the segment that contains the foci of the ellipse and has endpoints on the ellipse.',spanishTerm:"Eje mayor",spanishDefinition:'En una elipsis, el <span class="font-bold text-[#0055B2]">eje mayor</span> es el segmento que contiene los focos de la elipsis y tiene puntos extremos sobre la elipsis.'},{tid:"387",englishTerm:"Mapping diagram",englishDefinition:'A <span class="font-bold text-[#0055B2]">mapping diagram</span> describes a relation by linking elements of the domain with elements of the range.',spanishTerm:"Mapa",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">mapa</span> describe una relación al unir los elementos del dominio con los elementos del rango.'},{tid:"388",englishTerm:"Margin of error",englishDefinition:'The <span class="font-bold text-[#0055B2]">margin of error</span> of a sample statistic is the maximum expected difference between the sample statistic and the population parameter.',spanishTerm:"Margen de error",spanishDefinition:'El <span class="font-bold text-[#0055B2]">margen de error</span> de una estadística de muestreo aleatorio es la diferencia máxima que se espera entre la estadística de muestreo y el parámetro de la población.'},{tid:"389",englishTerm:"Marginal frequency",englishDefinition:'A <span class="font-bold text-[#0055B2]">marginal frequency</span> is an entry in the Total row or Total column of a two-way frequency table.',spanishTerm:"Frecuencia marginal",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">frecuencia marginal</span><insert space>es una entrada en la filaTotal oycolumnadelTotal de una tabla de frecuencias de doble entrada.'},{tid:"390",englishTerm:"Marginal relative frequency",englishDefinition:'A <span class="font-bold text-[#0055B2]">marginal relative frequency</span> is a marginal frequency in a two-way frequency table divided by the grand total for the table.',spanishTerm:"Frecuencia relativa marginal",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">frecuencia relativa marginal</span> es una frecuencia marginal en una tabla de frecuencias de doble entrada divididaopor el total de la tabla.'},{tid:"391",englishTerm:"Matrix",englishDefinition:'A <span class="font-bold text-[#0055B2]">matrix</span> is a rectangular array of numbers written within brackets.',spanishTerm:"Matriz",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">matriz</span> es un conjunto de números encerrados en corchetes y dispuestos en forma de rectángulo.'},{tid:"392",englishTerm:"Matrix element",englishDefinition:'Every item listed in a matrix is a <span class="font-bold text-[#0055B2]">matrix element</span>. A matrix element is identified by its position in the matrix.',spanishTerm:"Elemento matricial",spanishDefinition:'Cada cifra de una matriz es un <span class="font-bold text-[#0055B2]">elemento matricial</span> de la matriz. El elemento matricial se identifica según la posición que ocupa en la matriz.'},{tid:"393",englishTerm:"Matrix equation",englishDefinition:'A <span class="font-bold text-[#0055B2]">matrix equation</span> is an equation in which the variable is a matrix.',spanishTerm:"Ecuación matricial",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">ecuación matricial</span> es una ecuación en que la variable es una matriz.'},{tid:"401",englishTerm:"Measure of variation",englishDefinition:'<span class="font-bold text-[#0055B2]">Measure of variation</span>, such as the range, the interquartile range, and the standard deviation, describe how the data in a data set are spread out.',spanishTerm:"Medida de dispersión",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">medida de dispersión</span>, como el rango, el intervalo intercuartil y la desviación típica, describen cómo se dispersan los datos en un conjunto de datos.'},{tid:"403",englishTerm:"Median",englishDefinition:'The <span class="font-bold text-[#0055B2]">median</span> is the middle value in a data set. If the data set contains an even number of values, the median is the mean of the two middle values.',spanishTerm:"Mediana",spanishDefinition:'La <span class="font-bold text-[#0055B2]">mediana</span> es el valor situado en el medio en un conjunto de datos. Si el conjunto de datos contiene un número par de valores, la mediana es la media de los dos valores del medio.'},{tid:"405",englishTerm:"Midline",englishDefinition:'The <span class="font-bold text-[#0055B2]">midline</span> is the horizontal line through the average of the maximum and minimum values.',spanishTerm:"Línea media",spanishDefinition:'Recta horizontal que pasa a través de la <span class="font-bold text-[#0055B2]">línea media</span> de los valores máximos y mínimos.'},{tid:"411",englishTerm:"Minor arc",englishDefinition:'A <span class="font-bold text-[#0055B2]">minor arc</span> is an arc that is smaller than a semicircle.',spanishTerm:"Arco menor",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">arco menor</span> de un círculo es un arco más corto que un semicírculo.'},{tid:"412",englishTerm:"Minor axis",englishDefinition:'The <span class="font-bold text-[#0055B2]">minor axis</span> of an ellipse is the segment that is perpendicular to the major axis at its midpoint and has endpoints on the ellipse.',spanishTerm:"Eje menor",spanishDefinition:'En una elipsis, el <span class="font-bold text-[#0055B2]">eje menor</span> es el segmento perpendicular al eje mayor en su punto medio y que tiene puntos extremos sobre la elipsis.'},{tid:"413",englishTerm:"Mode",englishDefinition:'The <span class="font-bold text-[#0055B2]">mode</span> is the most frequently occurring value (or values) in a set of data. A data set may have no mode, one mode, or more than one mode.',spanishTerm:"Moda",spanishDefinition:'La <span class="font-bold text-[#0055B2]">moda</span> es el valor o valores que ocurren con mayor frequencia en un conjunto de datos. El conjunto de datos puede no tener moda, o tener una o más modas.'},{tid:"415",englishTerm:"Monomial",englishDefinition:'A <span class="font-bold text-[#0055B2]">monomial</span> is a real number, a variable, or a product of a real number and one or more variables with whole number exponents.',spanishTerm:"Monomio",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">monomio</span> es un número real, variable o el producto de un número real y una o más variables con números enteros como exponentes.'},{tid:"416",englishTerm:"Multiple zero",englishDefinition:'If a linear factor is repeated in the complete factored form of a polynomial, the zero related to that factor is a <span class="font-bold text-[#0055B2]">multiple zero</span>.',spanishTerm:"Cero múltiplo",spanishDefinition:'Si un factor lineal se repite en la forma factorizada completa de un polinomio, el cero relacionado con ese factor es un <span class="font-bold text-[#0055B2]">cero múltiplo</span>.'},{tid:"417",englishTerm:"Multiplication Counting Principle",englishDefinition:'The <span class="font-bold text-[#0055B2]">multiplication counting principle</span> states that if there are m ways to make the first selection and n ways to make the second selection, then there are m times n ways to make the two selections according to the multiplication counting principle.',spanishTerm:"Principio de Conteo en la Multiplicación",spanishDefinition:'Si hay m maneras de hacer la primera selección y n maneras de hacer la segunda selección, quiere decir que hay m multiplicado por n maneras de hacer las dos selecciones según el <span class="font-bold text-[#0055B2]">principio de conteo en la multiplicación</span>.'},{tid:"418",englishTerm:"Multiplicative identity",englishDefinition:'The <span class="font-bold text-[#0055B2]">multiplicative identity</span> is 1. The product of 1 and any number is that number. The product of reciprocals is 1.',spanishTerm:"Identidad multiplicativa",spanishDefinition:'La <span class="font-bold text-[#0055B2]">identidad multiplicativa</span> es 1. El producto de 1 y cualquier otro número es ese número. El producto del recíproco es 1.'},{tid:"422",englishTerm:"Multiplicity",englishDefinition:'The <span class="font-bold text-[#0055B2]">multiplicity</span> of a zero of a polynomial function is the number of times the related linear factor is repeated in the factored form of the polynomial.',spanishTerm:"Multiplicidad",spanishDefinition:'La <span class="font-bold text-[#0055B2]">multiplicidad</span> de un cero de una función polinomial es el número de veces que el factor lineal relacionado se repite en la forma factorizada del polinomio.'},{tid:"424",englishTerm:"n factorial",englishDefinition:'The product of the integers from n down to 1, for any positive integer n. You write <span class="font-bold text-[#0055B2]">n factorial</span> as n!. The value of 0! is defined to be 1.',spanishTerm:"n factorial",spanishDefinition:'Producto de todos los enteros desde n hasta 1, de cualquier entero positivo n. El factorial de n se escribe n!. El valor de <span class="font-bold text-[#0055B2]">n factorial</span> para 0 se define como 1.'},{tid:"425",englishTerm:"Natural base e",englishDefinition:'<span class="font-bold text-[#0055B2]">Natural base e</span> is the value that the expression (1 + 1/x)^x approaches as <x→ ∞. The value is approximately 2.7818282 . . .',spanishTerm:"Base natural e",spanishDefinition:'El valor al que se acerca la expresión (1 + 1/x)^x a medida que x → ∞, conocido como <span class="font-bold text-[#0055B2]">base natural e</span>, es aproximadamente igual a 2.7818282 . . .'},{tid:"428",englishTerm:"Natural numbers",englishDefinition:'The <span class="font-bold text-[#0055B2]">natural numbers</span> are the counting numbers.',spanishTerm:"Números naturales",spanishDefinition:'Los <span class="font-bold text-[#0055B2]">números naturales</span> son los que se emplean para contar.'},{tid:"429",englishTerm:"Negation",englishDefinition:'The <span class="font-bold text-[#0055B2]">negation</span> of a statement has the opposite meaning of the original statement.',spanishTerm:"Negación",spanishDefinition:'La <span class="font-bold text-[#0055B2]">negación</span> de un enunciado tiene el sentido opuesto del enunciado original.'},{tid:"430",englishTerm:"Negative association",englishDefinition:'When y-values tend to decrease as xvalues increase, the two data sets have a <span class="font-bold text-[#0055B2]">negative association</span>.',spanishTerm:"Asociación negativa",spanishDefinition:'Cuando los valores de y tienden a disminuir a medida que los valores de x aumentan, los dos conjuntos de datos tienen una <span class="font-bold text-[#0055B2]">asociación negativa</span>.'},{tid:"431",englishTerm:"Negative correlation",englishDefinition:'The relationship characterized by a <span class="font-bold text-[#0055B2]">negative correlation</span> between two sets of data, in which one set of data decreases as the other set of data increases.',spanishTerm:"Correlación negativa",spanishDefinition:'Relación entre dos conjuntos de datos en la que la <span class="font-bold text-[#0055B2]">correlación negativa</span> se presenta cuando uno de los conjuntos disminuye a medida que el otro se incrementa.'},{tid:"433",englishTerm:"Net",englishDefinition:'A <span class="font-bold text-[#0055B2]">net</span> is a two-dimensional pattern that you can fold to form a three-dimensional figure.',spanishTerm:"Plantilla",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">plantilla</span> es una figura bidimensional que se puede doblar para formar una figura tridimensional.'},{tid:"434",englishTerm:"n-gon",englishDefinition:'An <span class="font-bold text-[#0055B2]">n-gon</span> is a polygon with n sides.',spanishTerm:"n-ágono",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">n-ágono</span> es un polígono de n lados.'},{tid:"435",englishTerm:"No association",englishDefinition:'When there is no general relationship between x-values and y-values, the two data sets have <span class="font-bold text-[#0055B2]">no association</span>.',spanishTerm:"Sin asociación",spanishDefinition:'Cuando no existe ninguna relación general entre los valores de x y los valores de y, los dos conjuntos de datos no tienen ninguna <span class="font-bold text-[#0055B2]">sin asociación</span>.'},{tid:"436",englishTerm:"No correlation",englishDefinition:'There does not appear to be a relationship between two sets of data, indicating <span class="font-bold text-[#0055B2]">no correlation</span>.',spanishTerm:"Sin correlación",spanishDefinition:'No hay relación entre dos conjuntos de datos que se consideran <span class="font-bold text-[#0055B2]">sin correlación</span>.'},{tid:"437",englishTerm:"Nonagon",englishDefinition:'A <span class="font-bold text-[#0055B2]">nonagon</span> is a polygon with nine sides.',spanishTerm:"Nonágono",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">nonágono</span> es un polígono de nueve lados.'},{tid:"438",englishTerm:"Nonlinear function",englishDefinition:'A <span class="font-bold text-[#0055B2]">nonlinear function</span> is a function whose graph is not a line or part of a line.',spanishTerm:"Función no lineal",spanishDefinition:'<span class="font-bold text-[#0055B2]">Función no lineal</span> es una función cuya gráfica no es una línea o parte de una línea.'},{tid:"439",englishTerm:"Non-removable discontinuity",englishDefinition:'A <span class="font-bold text-[#0055B2]">non-removable discontinuity</span> is a point of discontinuity that is not removable. It represents a break in the graph of f where you cannot redefine f to make the graph continuous.',spanishTerm:"Discontinuidad irremovible",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">discontinuidad irremovible</span> es un punto de discontinuidad que no se puede remover. Representa una interrupción en la gráfica f donde no se puede redefinir f para volverla una gráfica continua.'},{tid:"440",englishTerm:"Non-rigid transformation",englishDefinition:'A <span class="font-bold text-[#0055B2]">non-rigid transformation</span> is a transformation in the plane that does not preserve distances.',spanishTerm:"Transformación no rígida",spanishDefinition:'<span class="font-bold text-[#0055B2]">Transformación no rígida</span> que se realiza en un plano y que no conserva las distancias.'},{tid:"441",englishTerm:"Normal distribution",englishDefinition:'A <span class="font-bold text-[#0055B2]">normal distribution</span> shows data that vary randomly from the mean in the pattern of a bell-shaped curve.',spanishTerm:"Distribución normal",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">distribución normal</span> muestra, con una curva en forma de campana, datos que varían aleatoriamente respecto de la media.'},{tid:"442",englishTerm:"Normal vectors",englishDefinition:'<span class="font-bold text-[#0055B2]">Normal vectors</span> are perpendicular vectors. Their dot product is 0.',spanishTerm:"Vectores normales",spanishDefinition:'Los <span class="font-bold text-[#0055B2]">vectores normales</span> son vectores perpendiculares. El producto escalar es 0.'},{tid:"444",englishTerm:"Null hypothesis",englishDefinition:'A <span class="font-bold text-[#0055B2]">null hypothesis</span> is a statement that expresses that there is no difference between the parameter and the benchmark.',spanishTerm:"Hipótesis nula",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">hipótesis nula</span> es un enunciado que expresa que no hay diferencia entre el parámetro y el punto de referencia.'},{tid:"445",englishTerm:"Null set",englishDefinition:'A <span class="font-bold text-[#0055B2]">null set</span> is a set that has no elements.',spanishTerm:"Conjunto vacío",spanishDefinition:'<span class="font-bold text-[#0055B2]">Conjunto vacío</span> que no tiene elementos.'},{tid:"446",englishTerm:"Numerical expression",englishDefinition:'A <span class="font-bold text-[#0055B2]">numerical expression</span> is a mathematical phrase involving numbers and operation symbols, but no variables.',spanishTerm:"Expresión numérica",spanishDefinition:'Frase matemática que contiene números y operaciones con símbolos, pero no variables, y que se conoce como <span class="font-bold text-[#0055B2]">expresión numérica</span>.'},{tid:"449",englishTerm:"Observational study",englishDefinition:'In an <span class="font-bold text-[#0055B2]">observational study</span>, you measure or observe members of a sample in such a way that they are not affected by the study.',spanishTerm:"Estudio de observación",spanishDefinition:'En un <span class="font-bold text-[#0055B2]">estudio de observación</span>, se miden u observan a los miembros de una muestra de tal manera que no les afecte el estudio.'},{tid:"450",englishTerm:"Obtuse angle",englishDefinition:'An <span class="font-bold text-[#0055B2]">obtuse angle</span> is an angle whose measure is between 90 degrees and 180 degrees.',spanishTerm:"Ángulo obtuso",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">ángulo obtuso</span> es un ángulo que mide entre 90 y 180 grados.'},{tid:"451",englishTerm:"Obtuse triangle",englishDefinition:'An <span class="font-bold text-[#0055B2]">obtuse triangle</span> has one obtuse angle.',spanishTerm:"Triángulo obtusángulo",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">triángulo obtusángulo</span> tiene un ángulo obtuso.'},{tid:"452",englishTerm:"Octagon",englishDefinition:'An <span class="font-bold text-[#0055B2]">octagon</span> is a polygon with eight sides.',spanishTerm:"Octágono",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">octágono</span> es un polígono de ocho lados.'},{tid:"454",englishTerm:"Odds",englishDefinition:'A ratio that compares the number of favorable and unfavorable outcomes. <span class="font-bold text-[#0055B2]">Odds</span> in favor are the number of favorable outcomes : number of unfavorable outcomes. Odds against are number of unfavorable outcomes : number of favorable outcomes.',spanishTerm:"Probabilidades",spanishDefinition:'Razón que compara el número de resultados favorables y no favorables. Las <span class="font-bold text-[#0055B2]">probabilidades</span> a favor son el número de resultados favorables : número de resultados no favorables. Las probabilidades en contra son el número de resultados no favorables : número de resultados favorables.'},{tid:"456",englishTerm:"Open sentence",englishDefinition:'An <span class="font-bold text-[#0055B2]">open sentence</span> is an equation that contains one or more variables and may be true or false depending on the value of its variables.',spanishTerm:"Enunciado abierto",spanishDefinition:'Una ecuación es un <span class="font-bold text-[#0055B2]">enunciado abierto</span> si contiene una o más variables y puede ser verdadera o falsa dependiendo del valor de sus variables.'},{tid:"458",englishTerm:"Opposite angles",englishDefinition:'<span class="font-bold text-[#0055B2]">Opposite angles</span> of a quadrilateral are two angles that do not share a side.',spanishTerm:"Ángulos opuestos",spanishDefinition:'Los <span class="font-bold text-[#0055B2]">ángulos opuestos</span> de un cuadrilátero son dos ángulos que no comparten lados.'},{tid:"459",englishTerm:"Opposite rays",englishDefinition:'<span class="font-bold text-[#0055B2]">Opposite rays</span> are collinear rays with the same endpoint. They form a line.',spanishTerm:"Semirrectas opuestas",spanishDefinition:'Las <span class="font-bold text-[#0055B2]">semirrectas opuestas</span> son semirrectas colineales con el mismo extremo. Forman una recta.'},{tid:"461",englishTerm:"Opposite sides",englishDefinition:'<span class="font-bold text-[#0055B2]">Opposite sides</span> of a quadrilateral are two sides that do not share a vertex.',spanishTerm:"Lados opuestos",spanishDefinition:'Los <span class="font-bold text-[#0055B2]">lados opuestos</span> de un cuadrilátero son dos lados que no tienen un vértice en común.'},{tid:"462",englishTerm:"Order of operations",englishDefinition:'The <span class="font-bold text-[#0055B2]">order of operations</span> is a sequence that involves: 1. Performing any operation(s) inside grouping symbols. 2. Simplifying powers. 3. Multiplying and dividing in order from left to right. 4. Adding and subtracting in order from left to right.',spanishTerm:"Orden de las operaciones",spanishDefinition:'1. En la <span class="font-bold text-[#0055B2]">orden de las operaciones</span>, se hacen las operaciones que están dentro de símbolos de agrupación. 2. En la orden de las operaciones, se simplifican todos los términos que tengan exponentes. 3. En la orden de las operaciones, se hacen las multiplicaciones y divisiones en orden de izquierda a derecha. 4. En la orden de las operaciones, se hacen las sumas y restas en orden de izquierda a derecha.'},{tid:"463",englishTerm:"Ordered pair",englishDefinition:'Two numbers that identify the location of a point known as an <span class="font-bold text-[#0055B2]">ordered pair</span>.',spanishTerm:"Par ordenado",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">par ordenado</span> de números que denota la ubicación de un punto.'},{tid:"466",englishTerm:"Origin",englishDefinition:'The <span class="font-bold text-[#0055B2]">origin</span> is the point at which the axes of the coordinate plane intersect.',spanishTerm:"Origen",spanishDefinition:'Punto de intersección de los ejes del plano de coordenadas, conocido como <span class="font-bold text-[#0055B2]">origen</span>.'},{tid:"468",englishTerm:"Orthographic drawing",englishDefinition:'An <span class="font-bold text-[#0055B2]">orthographic drawing</span> is the top view, front view, and right-side view of a three-dimensional figure.',spanishTerm:"Dibujo ortográfico",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">dibujo ortográfico</span> es la vista desde arriba, la vista de frente y la vista del lado derecho de una figura tridimensional.'},{tid:"470",englishTerm:"Outlier",englishDefinition:'An <span class="font-bold text-[#0055B2]">outlier</span> is a data value that is much higher or lower than the other data values in the set.',spanishTerm:"Valor extremo",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">valor extremo</span> es el valor de un dato que es mucho más alto o mucho más bajo que los otros valores del conjunto de datos.'},{tid:"473",englishTerm:"Parabola",englishDefinition:'A <span class="font-bold text-[#0055B2]">parabola</span> is the graph of a quadratic function. It is the set of all points P in a plane that are the same distance from a fixed point F, the focus, as they are from a line d, the directrix.',spanishTerm:"Parábola",spanishDefinition:'La <span class="font-bold text-[#0055B2]">parábola</span> es la gráfica de una función cuadrática. Es el conjunto de todos los puntos P situados en un plano a la misma distancia de un punto fijo F, o foco, y de la recta d, o directriz.'},{tid:"476",englishTerm:"Parallel planes",englishDefinition:'<span class="font-bold text-[#0055B2]">Parallel planes</span> are planes that do not intersect.',spanishTerm:"Planos paralelos",spanishDefinition:'<span class="font-bold text-[#0055B2]">Planos paralelos</span> son planos que no se cortan.'},{tid:"477",englishTerm:"Parallelogram",englishDefinition:'A <span class="font-bold text-[#0055B2]">parallelogram</span> is a quadrilateral with two pairs of parallel sides. You can choose any side to be the base. An altitude is any segment perpendicular to the line containing the base drawn from the side opposite the base. The height is the length of an altitude.',spanishTerm:"Paralelogramo",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">paralelogramo</span> es un cuadrilátero con dos pares de lados paralelos. Se puede escoger cualquier lado como la base. Una altura es un segmento perpendicular a la recta que contiene la base, trazada desde el lado opuesto a la base. La altura, por extensión, es la longitud de una altura.'},{tid:"478",englishTerm:"Parameter",englishDefinition:'A <span class="font-bold text-[#0055B2]">parameter</span> is a piece of data from a whole population, not from a sample.',spanishTerm:"Parámetro",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">parámetro</span> es un dato de una población completa, no de una muestra.'},{tid:"479",englishTerm:"Parent function",englishDefinition:'A <span class="font-bold text-[#0055B2]">parent function</span> is the simplest form of a set of functions that form a family.',spanishTerm:"Función elemental",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">función elemental</span> es la mínima expresión de un conjunto de funciones que forma una familia.'},{tid:"480",englishTerm:"Pascal’s Triangle",englishDefinition:'<span class="font-bold text-[#0055B2]">Pascal’s Triangle</span> is a triangular array of numbers in which the first and last number is 1. Each of the other numbers in the row is the sum of the two numbers above it.',spanishTerm:"Triángulo de Pascal",spanishDefinition:'El <span class="font-bold text-[#0055B2]">Triángulo de Pascal</span> es una distribución triangular de números en la cual el primer número y el último número son 1. Cada uno de los otros números en la fila es la suma de los dos números de encima.'},{tid:"481",englishTerm:"Pentagon",englishDefinition:'A <span class="font-bold text-[#0055B2]">pentagon</span> is a polygon with five sides.',spanishTerm:"Pentágono",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">pentágono</span> es un polígono de cinco lados.'},{tid:"482",englishTerm:"Percent change",englishDefinition:'The <span class="font-bold text-[#0055B2]">percent change</span> is the ratio of the amount of change to the original amount expressed as a percent.',spanishTerm:"Cambio porcentual",spanishDefinition:'La razón del <span class="font-bold text-[#0055B2]">cambio porcentual</span> en la cantidad de cambio y la cantidad original, expresada como un porcentaje.'},{tid:"483",englishTerm:"Percent decrease",englishDefinition:'The percent change found when the original amount experiences a <span class="font-bold text-[#0055B2]">percent decrease</span>.',spanishTerm:"Disminución porcentual",spanishDefinition:'Cambio porcentual que se encuentra cuando la <span class="font-bold text-[#0055B2]">disminución porcentual</span> de la cantidad original ocurre.'},{tid:"484",englishTerm:"Percent error",englishDefinition:'The <span class="font-bold text-[#0055B2]">percent error</span> is the ratio of the absolute value of the difference of the measured (or estimated) value and an actual value compared to the actual value, expressed as a percent.',spanishTerm:"Error porcentual",spanishDefinition:'El <span class="font-bold text-[#0055B2]">error porcentual</span> es la razón del valor absoluto de la diferencia de un valor medido (o estimado) y un valor actual en comparación con el valor actual, expresada como un porcentaje.'},{tid:"485",englishTerm:"Percent increase",englishDefinition:'The <span class="font-bold text-[#0055B2]">percent increase</span> is the percent change found when the original amount increases.',spanishTerm:"Aumento porcentual",spanishDefinition:'Cambio porcentual que se encuentra cuando la cantidad original aumenta, resultando en un <span class="font-bold text-[#0055B2]">aumento porcentual</span>.'},{tid:"486",englishTerm:"Percentile",englishDefinition:'A <span class="font-bold text-[#0055B2]">percentile</span> is the percentage of values less than or equal to a particular data value. It is equal to the percentage of the total area under the distribution curve for the population to the left of that value.',spanishTerm:"Percentil",spanishDefinition:'Valor que separa el conjunto de datos en 100 partes iguales mediante el <span class="font-bold text-[#0055B2]">percentil</span>.'},{tid:"487",englishTerm:"Percentile rank",englishDefinition:'The <span class="font-bold text-[#0055B2]">percentile rank</span> is the percentage of data values that are less than or equal to a given value.',spanishTerm:"Rango percentil",spanishDefinition:'Porcentaje de valores de datos que son menores o iguales que un valor dado en el <span class="font-bold text-[#0055B2]">rango percentil</span>.'},{tid:"488",englishTerm:"Perfect square trinomial",englishDefinition:'A <span class="font-bold text-[#0055B2]">perfect square trinomial</span> is a trinomial that is the square of a binomial.',spanishTerm:"Trinomio cuadrado perfecto",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">trinomio cuadrado perfecto</span> es un trinomio que es el cuadrado de un binomio.'},{tid:"489",englishTerm:"Perfect squares",englishDefinition:'Numbers whose square roots are integers and are considered <span class="font-bold text-[#0055B2]">perfect squares</span>.',spanishTerm:"Cuadrado perfecto",spanishDefinition:'Número cuya raíz cuadrada es un número entero y que se denomina <span class="font-bold text-[#0055B2]">cuadrado perfecto</span>.'},{tid:"491",englishTerm:"Period",englishDefinition:'The <span class="font-bold text-[#0055B2]">period</span> of a periodic function is the horizontal length of one cycle.',spanishTerm:"Período",spanishDefinition:'El <span class="font-bold text-[#0055B2]">período</span> de una función periódica es el intervalo horizontal de un ciclo.'},{tid:"492",englishTerm:"Periodic function",englishDefinition:'A <span class="font-bold text-[#0055B2]">periodic function</span> repeats a pattern of y-values at regular intervals.',spanishTerm:"Función periódica",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">función periódica</span> repite un patrón de valores y a intervalos regulares.'},{tid:"494",englishTerm:"Perpendicular bisector",englishDefinition:'The <span class="font-bold text-[#0055B2]">perpendicular bisector</span> of a segment is a line, segment, or ray that is perpendicular to the segment at its midpoint.',spanishTerm:"Mediatriz",spanishDefinition:'La <span class="font-bold text-[#0055B2]">mediatriz</span> de un segmento es una recta, segmento o semirrecta que es perpendicular al segmento en su punto medio.'},{tid:"496",englishTerm:"Perspective drawing",englishDefinition:'<span class="font-bold text-[#0055B2]">Perspective drawing</span> is a way of drawing objects on a flat surface so that they look the same way as they appear to the eye. In one-point perspective, there is one vanishing point. In two-point perspective, there are two vanishing points.',spanishTerm:"Dibujar en perspectiva",spanishDefinition:'<span class="font-bold text-[#0055B2]">Dibujar en perspectiva</span> es una manera de dibujar objetos en una superficie plana de modo que se vean como los percibe el ojo humano. En la perspectiva de un punto hay un punto de fuga. En la perspectiva de dos puntos hay dos puntos de fuga.'},{tid:"497",englishTerm:"Phase shift",englishDefinition:'A horizontal translation of a periodic function is a <span class="font-bold text-[#0055B2]">phase shift</span>.',spanishTerm:"Cambio de fase",spanishDefinition:'Una traslación horizontal de una función periódica es un <span class="font-bold text-[#0055B2]">cambio de fase</span>.'},{tid:"499",englishTerm:"Piecewise function",englishDefinition:'A <span class="font-bold text-[#0055B2]">piecewise function</span> has different rules for different parts of its domain.',spanishTerm:"Función de fragmentos",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">función de fragmentos</span> tiene reglas diferentes para diferentes partes de su dominio.'},{tid:"506",englishTerm:"Point symmetry",englishDefinition:'<span class="font-bold text-[#0055B2]">Point symmetry</span> is the type of symmetry for which there is a rotation of 180 degrees that maps a figure onto itself.',spanishTerm:"Simetría central",spanishDefinition:'La <span class="font-bold text-[#0055B2]">simetría central</span> es un tipo de simetría en la que una figura se ha rotado 180° sobre sí misma.'},{tid:"509",englishTerm:"Polygon",englishDefinition:'A <span class="font-bold text-[#0055B2]">polygon</span> is a closed plane figure formed by three or more segments. Each segment intersects exactly two other segments, but only at their endpoints, and no two segments with a common endpoint are collinear. The vertices of the polygon are the endpoints of the sides. A diagonal is a segment that connects two nonconsecutive vertices. A polygon is convex if no diagonal contains points outside the polygon. A polygon is concave if a diagonal contains points outside the polygon.',spanishTerm:"Polígono",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">polígono</span> es una figura plana compuesta por tres o más segmentos. Cada segmento interseca los otros dos segmentos exactamente, pero únicamente en sus puntos extremos y ningúno de los segmentos con extremos comunes son colineales. Los vértices del polígono son los extremos de los lados. Una diagonal es un segmento que conecta dos vértices no consecutivos. Un polígono es convexo si ninguna diagonal tiene puntos fuera del polígono. Un polígono es cóncavo si una diagonal tiene puntos fuera del polígono.'},{tid:"510",englishTerm:"Polyhedron",englishDefinition:'A <span class="font-bold text-[#0055B2]">polyhedron</span> is a three-dimensional figure whose surfaces, or faces, are polygons. The vertices of the polygons are the vertices of the polyhedron. The intersections of the faces are the edges of the polyhedron.',spanishTerm:"Poliedro",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">poliedro</span> es una figura tridimensional cuyas superficies, o caras, son polígonos. Los vértices de los polígonos son los vértices del poliedro. Las intersecciones de las caras son las aristas del poliedro.'},{tid:"511",englishTerm:"Polynomial",englishDefinition:'A monomial or the sum or difference of two or more monomials. A quotient with a variable in the denominator is not a <span class="font-bold text-[#0055B2]">polynomial</span>.',spanishTerm:"Polinomio",spanishDefinition:'Un monomio o la suma o diferencia de dos o más monomios. Un cociente con una variable en el denominador no es un <span class="font-bold text-[#0055B2]">polinomio</span>.'},{tid:"512",englishTerm:"Polynomial function",englishDefinition:'A polynomial in the variable x defines a <span class="font-bold text-[#0055B2]">polynomial function</span> of x.',spanishTerm:"Función polinomial",spanishDefinition:'Un polinomio en la variable x define una <span class="font-bold text-[#0055B2]">función polinomial</span> de x.'},{tid:"513",englishTerm:"Population",englishDefinition:'The entire group of individuals or items that constitutes the <span class="font-bold text-[#0055B2]">population</span> from which you are collecting information.',spanishTerm:"Población",spanishDefinition:'El grupo entero del cual juntas información sobre la <span class="font-bold text-[#0055B2]">población</span>.'},{tid:"514",englishTerm:"Population density",englishDefinition:'<span class="font-bold text-[#0055B2]">Population density</span> is the number of individuals of a population divided by the total area or volume that they occupy.',spanishTerm:"Densidad de población",spanishDefinition:'La <span class="font-bold text-[#0055B2]">densidad de población</span> es el número de individuos de una población divididadivididopor el área total o el volumen total que ocupanlos individuos.'},{tid:"515",englishTerm:"Positive association",englishDefinition:'When y-values tend to increase as x-values increase, the two data sets have a <span class="font-bold text-[#0055B2]">positive association</span>.',spanishTerm:"Asociación positiva",spanishDefinition:'Cuando los valores de y tienden a aumentar a medida que los valores de x aumentan, los dos conjuntos de datos tienen una <span class="font-bold text-[#0055B2]">asociación positiva</span>.'},{tid:"516",englishTerm:"Positive correlation",englishDefinition:'The relationship known as <span class="font-bold text-[#0055B2]">positive correlation</span> exists between two sets of data in which both sets of data increase together.',spanishTerm:"Correlación positiva",spanishDefinition:'La <span class="font-bold text-[#0055B2]">correlación positiva</span> es la relación entre dos conjuntos de datos en la que ambos conjuntos se incrementan a la vez.'},{tid:"517",englishTerm:"Postulate",englishDefinition:'A <span class="font-bold text-[#0055B2]">postulate</span>, or axiom, is an accepted statement of fact.',spanishTerm:"Postulado",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">postulado</span>, o axioma, es un enunciado que se acepta como un hecho.'},{tid:"523",englishTerm:"Prism",englishDefinition:'A <span class="font-bold text-[#0055B2]">prism</span> is a polyhedron with two congruent and parallel faces, which are called the bases. The other faces, which are parallelograms, are called the lateral faces. An altitude of a prism is a perpendicular segment that joins the planes of the bases. Its length is the height of the prism. A right prism is one whose lateral faces are rectangular regions and a lateral edge is an altitude. In an oblique prism, some or all of the lateral faces are nonrectangular.',spanishTerm:"Prisma",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">prisma</span> es un poliedro con dos caras congruentes paralelas llamadas bases. Las otras caras son paralelogramos llamados caras laterales. La altura de un prisma es un segmento perpendicular que une los planos de las bases. Su longitud es también la altura del prisma. En un prisma rectangular, las caras laterales son rectangulares y una de las aristas laterales es la altura. En un prisma oblicuo, algunas o todas las caras laterales no son rectangulares.'},{tid:"524",englishTerm:"Probability",englishDefinition:'How likely it is that an event will occur, written formally as P(event), is known as <span class="font-bold text-[#0055B2]">probability</span>.',spanishTerm:"Probabilidad",spanishDefinition:'La <span class="font-bold text-[#0055B2]">probabilidad</span> es la posibilidad de que un suceso ocurra, escrita formalmente P(suceso).'},{tid:"525",englishTerm:"Probability distribution",englishDefinition:'A <span class="font-bold text-[#0055B2]">probability distribution</span> is a function that tells the probability of each outcome in a sample space.',spanishTerm:"Distribución de probabilidades",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">distribución de probabilidades</span> es una función que señala la probabilidad de que cada resultado ocurra en un espacio muestral.'},{tid:"527",englishTerm:"Proof",englishDefinition:'A <span class="font-bold text-[#0055B2]">proof</span> is a convincing argument that uses deductive reasoning. A proof can be written in many forms. In a two-column proof, the statements and reasons are aligned in columns. In a paragraph proof, the statements and reasons are connected in sentences. In a flow proof, arrows show the logical connections between the statements. In a coordinate proof, a figure is drawn on a coordinate plane and the formulas for slope, midpoint, and distance are used to prove properties of the figure. An indirect proof involves the use of indirect reasoning.',spanishTerm:"Prueba",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">prueba</span> es un argumento convincente en el cual se usa el razonamiento deductivo. Una prueba se puede escribir de varias maneras. En una prueba de dos columnas, los enunciados y las razones se alinean en columnas. En una prueba de párrafo, los enunciados y razones están unidos en oraciones. En una prueba de flujo, hay flechas que indican las conexiones lógicas entre enunciados. En una prueba de coordenadas, se dibuja una figura en un plano de coordenadas y se usan las fórmulas de la pendiente, punto medio y distancia para probar las propiedades de la figura. Una prueba indirecta incluye el uso de razonamiento indirecto.'},{tid:"529",englishTerm:"Proportion",englishDefinition:'A <span class="font-bold text-[#0055B2]">proportion</span> is a statement that two ratios are equal. An extended proportion is a statement that three or more ratios are equal.',spanishTerm:"Proporción",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">proporción</span> es un enunciado en el cual dos razones son iguales. Una proporción extendida es un enunciado que dice que tres razones o más son iguales.'},{tid:"534",englishTerm:"Quadrants",englishDefinition:'The four parts into which the coordinate plane is divided by its axes, are referred to as <span class="font-bold text-[#0055B2]">quadrants</span>.',spanishTerm:"Cuadrantes",spanishDefinition:'El plano de coordenadas está dividido por sus ejes en cuatro regiones llamadas <span class="font-bold text-[#0055B2]">cuadrantes</span>.'},{tid:"539",englishTerm:"Quadratic regression",englishDefinition:'A method used to find the <span class="font-bold text-[#0055B2]">quadratic regression</span> function that best fits a data set.',spanishTerm:"Regresión cuadrática",spanishDefinition:'La <span class="font-bold text-[#0055B2]">regresión cuadrática</span> es un método que se usa para hallar la mayor aproximación a un conjunto de datos cuadráticos.'},{tid:"540",englishTerm:"Quadrilateral",englishDefinition:'A <span class="font-bold text-[#0055B2]">quadrilateral</span> is a polygon with four sides.',spanishTerm:"Cuadrilátero",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">cuadrilátero</span> es un polígono de cuatro lados.'},{tid:"541",englishTerm:"Qualitative",englishDefinition:'Data that name qualities are <span class="font-bold text-[#0055B2]">qualitative</span>.',spanishTerm:"Cualitativo",spanishDefinition:'Los datos que indican cualidades son <span class="font-bold text-[#0055B2]">cualitativo</span>s.'},{tid:"542",englishTerm:"Quantitative",englishDefinition:'Data that measure quantity and can be described numerically are <span class="font-bold text-[#0055B2]">quantitative</span>.',spanishTerm:"Cuantitativo",spanishDefinition:'Los datos que miden cantidades y pueden ser descritos numéricamente son <span class="font-bold text-[#0055B2]">cuantitativo</span>s.'},{tid:"543",englishTerm:"Quantitative variable",englishDefinition:'A <span class="font-bold text-[#0055B2]">quantitative variable</span> is a variable for which the possible values are numbers that can be meaningfully counted, added, subtracted, and so on.',spanishTerm:"Variable cuantitativa",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">variable cuantitativa</span> es una variable para la cual los valores posibles son números que se pueden contar, sumar, restar, y así, de manera significativa.'},{tid:"544",englishTerm:"Quantity",englishDefinition:'<span class="font-bold text-[#0055B2]">Quantity</span> is anything that can be measured or counted.',spanishTerm:"Cantidad",spanishDefinition:'<span class="font-bold text-[#0055B2]">Cantidad</span> es cualquier cosa que se puede medir o contar.'},{tid:"547",englishTerm:"Radian Measure",englishDefinition:'The <span class="font-bold text-[#0055B2]">radian measure</span> of a central angle of a circle is the ratio of the length of the intercepted arc to the radius of the circle. One radian is the measure of a central angle that intercepts an arc with length equal to the radius of the circle. On a unit circle, the radian measure of a central angle is the length of the arc it intercepts.',spanishTerm:"Medida en radianes",spanishDefinition:'La <span class="font-bold text-[#0055B2]">medida en radianes</span> de un ángulo central de un círculo es la razón de la longitud del arco interceptado al radio del círculo. Un radián es la medida de un ángulo central que intercepta un arco con ununalongitud igual al radio del círculo. En un círculo unitario, la medida en radianes de un ángulo central es la longitud del arco que este intercepta.'},{tid:"548",englishTerm:"Radical",englishDefinition:'An expression made up of a <span class="font-bold text-[#0055B2]">radical</span> symbol and a radicand.',spanishTerm:"Radical",spanishDefinition:'Expresión compuesta por un símbolo <span class="font-bold text-[#0055B2]">radical</span> y un radicando.'},{tid:"549",englishTerm:"Radical equation",englishDefinition:'An equation that has a variable in a radicand, which is part of the <span class="font-bold text-[#0055B2]">radical equation</span>.',spanishTerm:"Ecuación radical",spanishDefinition:'<span class="font-bold text-[#0055B2]">Ecuación radical</span> que tiene una variable en un radicando.'},{tid:"550",englishTerm:"Radical expression",englishDefinition:'An expression that contains a <span class="font-bold text-[#0055B2]">radical expression</span>.',spanishTerm:"Expresión radical",spanishDefinition:'Expresiones que contienen la <span class="font-bold text-[#0055B2]">expresión radical</span>.'},{tid:"552",englishTerm:"Radicand",englishDefinition:'The expression under the radical sign is the <span class="font-bold text-[#0055B2]">radicand</span>.',spanishTerm:"Radicando",spanishDefinition:'La expresión que aparece debajo del signo radical es el <span class="font-bold text-[#0055B2]">radicando</span>.'},{tid:"556",englishTerm:"Random sample",englishDefinition:'In a <span class="font-bold text-[#0055B2]">random sample</span>, all members of the population are equally likely to be chosen as every other member.',spanishTerm:"Muestra aleatoria",spanishDefinition:'En una <span class="font-bold text-[#0055B2]">muestra aleatoria</span>, la probabilidad de ser seleccionado es igual para todos los miembros.'},{tid:"562",englishTerm:"Rational equation",englishDefinition:'A <span class="font-bold text-[#0055B2]">rational equation</span> is an equation that contains a rational expression.',spanishTerm:"Ecuación racional",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">ecuación racional</span> es una ecuación que contiene una expresión racional.'},{tid:"564",englishTerm:"Rational expression",englishDefinition:'A <span class="font-bold text-[#0055B2]">rational expression</span> is the quotient of two polynomials.',spanishTerm:"Expresión racional",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">expresión racional</span> es el cociente de dos polinomios.'},{tid:"566",englishTerm:"Rational number",englishDefinition:'A real number that can be written as a ratio of two integers. <span class="font-bold text-[#0055B2]">Rational number</span>s in decimal form are terminating or repeating.',spanishTerm:"Número racional",spanishDefinition:'Número real que puede expresarse como la razón de dos números enteros, por lo que se considera un <span class="font-bold text-[#0055B2]">número racional</span>. Los números racionales en forma decimal son exactos o periódicos.'},{tid:"568",englishTerm:"Rationalize the denominator",englishDefinition:'To <span class="font-bold text-[#0055B2]">rationalize the denominator</span> of an expression, rewrite it so there are no radicals in any denominator and no denominators in any radical.',spanishTerm:"Racionalizar el denominador",spanishDefinition:'Para <span class="font-bold text-[#0055B2]">racionalizar el denominador</span> de una expresión, esta se escribe de modo que no haya radicales en ningún denominador y no haya denominadores en ningún radical.'},{tid:"569",englishTerm:"Ray",englishDefinition:'A <span class="font-bold text-[#0055B2]">ray</span> is the part of a line that consists of one endpoint and all the points of the line on one side of the endpoint.',spanishTerm:"Semirrecta",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">semirrecta</span> es la parte de una recta que tiene un extremo de donde parten todos los puntos de la recta.'},{tid:"570",englishTerm:"Real axis",englishDefinition:'The <span class="font-bold text-[#0055B2]">real axis</span> is the horizontal axis in the complex plane.',spanishTerm:"Eje real",spanishDefinition:'El <span class="font-bold text-[#0055B2]">eje real</span> es el eje horizontal en el plano complejo.'},{tid:"571",englishTerm:"Real number",englishDefinition:'A <span class="font-bold text-[#0055B2]">real number</span> is a number that is either rational or irrational.',spanishTerm:"Número real",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">número real</span> que es o racional o irracional.'},{tid:"575",englishTerm:"Reciprocal trigonometric functions",englishDefinition:'Trigonometric functions formed by inverting the ratio of a given trigonometric function are <span class="font-bold text-[#0055B2]">reciprocal trigonometric functions</span>.',spanishTerm:"Función trigonométrica recíprocas",spanishDefinition:'Las <span class="font-bold text-[#0055B2]">función trigonométrica recíprocas</span> son funciones trigonométricas formadas al invertir la relación de una función trigonométrica dada.'},{tid:"576",englishTerm:"Rectangle",englishDefinition:'A <span class="font-bold text-[#0055B2]">rectangle</span> is a parallelogram with four right angles.',spanishTerm:"Rectángulo",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">rectángulo</span> es un paralelogramo con cuatro ángulos rectos.'},{tid:"577",englishTerm:"Recursive formula",englishDefinition:'A <span class="font-bold text-[#0055B2]">recursive formula</span> defines the terms in a sequence by relating each term to the ones before it.',spanishTerm:"Fórmula recursiva",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">fórmula recursiva</span> define los términos de una secuencia al relacionar cada término con los términos que lo anteceden.'},{tid:"578",englishTerm:"Reduced radical form",englishDefinition:'<span class="font-bold text-[#0055B2]">Reduced radical form</span> is the form of an expression for which all nth roots of prefect nth powers in the radicand have been simplified and no radicals remain in the denominator.',spanishTerm:"Forma radical reducida",spanishDefinition:'La <span class="font-bold text-[#0055B2]">forma radical reducida</span> es la forma de una expresión en la cual todas las raíces enésimas de potencias enésimas perfectas en el radicando se han simplificado y no quedan radicales en el denominador.'},{tid:"581",englishTerm:"Reference angle",englishDefinition:'For an angle in standard position, the <span class="font-bold text-[#0055B2]">reference angle</span> is the acute angle formed between the terminal side of the angle and the x-axis.',spanishTerm:"Ángulo de referencia",spanishDefinition:'Para un ángulo en posición estándar, el <span class="font-bold text-[#0055B2]">ángulo de referencia</span> es el ángulo agudo que se forma entre el lado terminal del ángulo y el eje x.'},{tid:"582",englishTerm:"Reference triangle",englishDefinition:'A <span class="font-bold text-[#0055B2]">reference triangle</span> is the triangle formed by drawing a perpendicular line from the terminal point on the unit circle of an angle in standard position to the x-axis.',spanishTerm:"Triángulo de referencia",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">triángulo de referencia</span> es el triángulo que se forma al trazar una recta perpendicular desde el punto terminal en el círculo unitario de un ángulo en posición estándar hasta el eje x.'},{tid:"583",englishTerm:"Reflection",englishDefinition:'A <span class="font-bold text-[#0055B2]">reflection</span> flips the graph of a function across a line, such as the x- or y-axis. Each point on the graph of the reflected function is the same distance from the line of reflection as is the corresponding point on the graph of the original function.',spanishTerm:"Reflexión",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">reflexión</span> voltea la gráfica de una función sobre una línea, como el eje de las x o el eje de las y. Cada punto de la gráfica de la función reflejada está a la misma distancia del eje de reflexión que el punto correspondiente en la gráfica de la función original.'},{tid:"584",englishTerm:"Reflectional symmetry",englishDefinition:'<span class="font-bold text-[#0055B2]">Reflectional symmetry</span>, or line symmetry, is the type of symmetry for which there is a reflection that maps a figure onto itself. The reflection line is the line of symmetry. The line of symmetry divides a figure with reflectional symmetry into two congruent halves.',spanishTerm:"Simetría reflexiva",spanishDefinition:'<span class="font-bold text-[#0055B2]">Simetría reflexiva</span>, o simetría lineal, es el tipo de simetría donde hay una reflexión que ubica una figura en sí misma. El eje de reflexión es el eje de simetría. El eje de simetría divide una figura con simetría reflexiva en dos mitades congruentes.'},{tid:"585",englishTerm:"Reflexive Property",englishDefinition:'Given a real number a, the <span class="font-bold text-[#0055B2]">Reflexive Property</span> of Equality states that a = a.',spanishTerm:"Propiedad reflexiva",spanishDefinition:'Dado un número real a, la <span class="font-bold text-[#0055B2]">propiedad reflexiva</span> de la igualdad establece que a = a.'},{tid:"586",englishTerm:"Regular polygon",englishDefinition:'A <span class="font-bold text-[#0055B2]">regular polygon</span> is a polygon that is both equilateral and equiangular. Its center is the point that is equidistant from its vertices.',spanishTerm:"Polígono regular",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">polígono regular</span> es un polígono que es equilateral y equiangular. Su centro es el punto equidistante de sus vértices.'},{tid:"588",englishTerm:"Relation",englishDefinition:'Any set of ordered pairs is known as a <span class="font-bold text-[#0055B2]">relation</span>.',spanishTerm:"Relación",spanishDefinition:'Cualquier conjunto de pares ordenados que establece una <span class="font-bold text-[#0055B2]">relación</span> entre elementos.'},{tid:"589",englishTerm:"Relative error",englishDefinition:'The ratio of the absolute value of the difference of a measured (or estimated) value and an actual value compared to the actual value, is known as <span class="font-bold text-[#0055B2]">relative error</span>.',spanishTerm:"Error relativo",spanishDefinition:'Razón del valor absoluto de la diferencia de un valor medido (o estimado) y un valor actual en comparación con el valor actual, que se conoce como <span class="font-bold text-[#0055B2]">error relativo</span>.'},{tid:"590",englishTerm:"Relative frequency",englishDefinition:'The <span class="font-bold text-[#0055B2]">relative frequency</span> of an event is the ratio of the number of times the even occurs to the total number of trials.',spanishTerm:"Frecuencia relativa",spanishDefinition:'La <span class="font-bold text-[#0055B2]">frecuencia relativa</span> de un suceso es la razón del número de veces que ocurre un evento al número de eventos en el espacio muestral.'},{tid:"593",englishTerm:"Remote interior angles",englishDefinition:'<span class="font-bold text-[#0055B2]">Remote interior angles</span> are the two nonadjacent interior angles corresponding to each exterior angle of a triangle.',spanishTerm:"Ángulos interiores remotos",spanishDefinition:'Los <span class="font-bold text-[#0055B2]">ángulos interiores remotos</span> son los dos ángulos interiores no adyacentes que corresponden a cada ángulo exterior de un triángulo.'},{tid:"595",englishTerm:"Residual",englishDefinition:'The difference between the y-value of a data point and the corresponding y-value of a model for the data set is known as the <span class="font-bold text-[#0055B2]">residual</span>.',spanishTerm:"Residuo",spanishDefinition:'La diferencia entre el valor de y de un punto y el valor de y correspondiente a ese punto en el modelo del conjunto de datos, se denomina <span class="font-bold text-[#0055B2]">residuo</span>.'},{tid:"596",englishTerm:"Rhombus",englishDefinition:'A <span class="font-bold text-[#0055B2]">rhombus</span> is a parallelogram with four congruent sides.',spanishTerm:"Rombo",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">rombo</span> es un paralelogramo de cuatro lados congruentes.'},{tid:"597",englishTerm:"Right angle",englishDefinition:'A <span class="font-bold text-[#0055B2]">right angle</span> is an angle whose measure is 90 degrees.',spanishTerm:"Ángulo recto",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">ángulo recto</span> es un ángulo que mide 90.'},{tid:"601",englishTerm:"Right triangle",englishDefinition:'A <span class="font-bold text-[#0055B2]">right triangle</span> contains one right angle. The side opposite the right angle is the hypotenuse and the other two sides are the legs.',spanishTerm:"Triángulo rectángulo",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">triángulo rectángulo</span> contiene un ángulo recto. El lado opuesto del ángulo recto es la hipotenusa y los otros dos lados son los catetos.'},{tid:"602",englishTerm:"Rigid motion",englishDefinition:'A <span class="font-bold text-[#0055B2]">rigid motion</span> is a transformation that preserves distance and angle measure. A rigid motion is sometimes called a congruence transformation.',spanishTerm:"Movimiento rígido",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">movimiento rígido</span> es una transformación en el plano que no cambia la distancia ni la medida del ángulo. Los movimientos rígidos se conocen a veces como transformaciones de congruencia.'},{tid:"603",englishTerm:"Root",englishDefinition:'A <span class="font-bold text-[#0055B2]">root</span> of a function is the input value for which the value of the function is zero. A root of an equation is a value that makes the equation true. See also Zero of a function.',spanishTerm:"Raíz",spanishDefinition:'La <span class="font-bold text-[#0055B2]">raíz</span> de una función es el valor de entrada para el cual el valor de la función es cero. La raíz de una ecuación es un valor que hace verdadera la ecuación. Ver también Zero of a function.'},{tid:"604",englishTerm:"Roster form",englishDefinition:'A notation for listing all of the elements in a set using set braces and commas, is known as <span class="font-bold text-[#0055B2]">roster form</span>.',spanishTerm:"Lísta",spanishDefinition:'Una notación en la que se enlistan todos los elementos en un conjunto usando llaves y comas, formando así una <span class="font-bold text-[#0055B2]">lísta</span>.'},{tid:"606",englishTerm:"Rotational symmetry",englishDefinition:'<span class="font-bold text-[#0055B2]">Rotational symmetry</span> is the type of symmetry for which there is a rotation of 180 degrees or less that maps a figure onto itself.',spanishTerm:"Simetría rotacional",spanishDefinition:'La <span class="font-bold text-[#0055B2]">simetría rotacional</span> es un tipo de simetría en la que una rotación de 180 grados o menos vuelve a trazar una figura sobre sí misma.'},{tid:"607",englishTerm:"Row operation",englishDefinition:'A <span class="font-bold text-[#0055B2]">row operation</span> on an augmented matrix is any of the following: switch two rows, multiply a row by a constant, add one row to another.',spanishTerm:"Operación de fila",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">operación de fila</span> en una matriz ampliada es cualquiera de las siguientes opciones: el intercambio de dos filas, la multiplicación de una fila por una constante o la suma de dos filas.'},{tid:"609",englishTerm:"Sample",englishDefinition:'<span class="font-bold text-[#0055B2]">Sample</span> is the part of a population that is surveyed.',spanishTerm:"Muestra",spanishDefinition:'<span class="font-bold text-[#0055B2]">Muestra</span> es la porción que se estudia de una población.'},{tid:"610",englishTerm:"Sample space",englishDefinition:'All possible outcomes in a situation that make up the <span class="font-bold text-[#0055B2]">sample space</span>.',spanishTerm:"Espacio muestral",spanishDefinition:'Todos los resultados posibles de una situación que conforman el <span class="font-bold text-[#0055B2]">espacio muestral</span>.'},{tid:"611",englishTerm:"Sampling distribution",englishDefinition:'A <span class="font-bold text-[#0055B2]">sampling distribution</span> is the distribution of sample statistics from different samples of the same population.',spanishTerm:"Distribución muestral",spanishDefinition:'La <span class="font-bold text-[#0055B2]">distribución muestral</span> es la distribución de las estadísticas muestrales de diferentes muestras de la misma población.'},{tid:"615",englishTerm:"Scale drawing",englishDefinition:'A <span class="font-bold text-[#0055B2]">scale drawing</span> is a drawing in which all lengths are proportional to corresponding actual lengths.',spanishTerm:"Dibujo a escala",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">dibujo a escala</span> es un dibujo en el que todas las longitudes son proporcionales a las longitudes verdaderas correspondientes.'},{tid:"616",englishTerm:"Scale factor",englishDefinition:'A <span class="font-bold text-[#0055B2]">scale factor</span> is the ratio of corresponding linear measurements of two similar figures.',spanishTerm:"Factor de escala",spanishDefinition:'El <span class="font-bold text-[#0055B2]">factor de escala</span> es la razón de las medidas lineales correspondientes de dos figuras semejantes.'},{tid:"618",englishTerm:"Scale model",englishDefinition:'A three-dimensional model that is similar to a three-dimensional object, known as a <span class="font-bold text-[#0055B2]">scale model</span>.',spanishTerm:"Modelo de escala",spanishDefinition:'Modelo tridimensional que es similar a un objeto tridimensional y que se conoce como <span class="font-bold text-[#0055B2]">modelo de escala</span>.'},{tid:"619",englishTerm:"Scalene triangle",englishDefinition:'A <span class="font-bold text-[#0055B2]">scalene triangle</span> has no congruent sides.',spanishTerm:"Triángulo escaleno",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">triángulo escaleno</span> no tiene lados congruentes.'},{tid:"620",englishTerm:"Scatter plot",englishDefinition:'A <span class="font-bold text-[#0055B2]">scatter plot</span> is a graph that relates two different sets of data by plotting the data as ordered pairs. You can use a scatter plot to determine a relationship between the data sets.',spanishTerm:"Diagrama de puntos",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">diagrama de puntos</span> es una gráfica que relaciona dos conjuntos de datos presentando los datos como pares ordenados. El diagrama de puntos sirve para definir la relación entre conjuntos de datos.'},{tid:"622",englishTerm:"Secant",englishDefinition:'A <span class="font-bold text-[#0055B2]">secant</span> is a line, ray, or segment that intersects a circle at two points.',spanishTerm:"Secante",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">secante</span> es una recta, semirrecta o segmento que corta un círculo en dos puntos.'},{tid:"626",englishTerm:"Segment bisector",englishDefinition:'A <span class="font-bold text-[#0055B2]">segment bisector</span> is a line, segment, ray, or plane that intersects a segment at its midpoint.',spanishTerm:"Bisectriz de un segmento",spanishDefinition:'La <span class="font-bold text-[#0055B2]">bisectriz de un segmento</span> es una recta, segmento, semirrecta o plano que corta un segmento en su punto medio.'},{tid:"628",englishTerm:"Self-selected sample",englishDefinition:'In a <span class="font-bold text-[#0055B2]">self-selected sample</span> you select only members of the population who volunteered for the sample.',spanishTerm:"Muestra de voluntarios",spanishDefinition:'En una <span class="font-bold text-[#0055B2]">muestra de voluntarios</span> se seleccionan sólo a los miembros de la población que se ofrecen voluntariamente para ser parte de la muestra.'},{tid:"629",englishTerm:"Semicircle",englishDefinition:'A <span class="font-bold text-[#0055B2]">semicircle</span> is half a circle.',spanishTerm:"Semicírculo",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">semicírculo</span> es la mitad de un círculo.'},{tid:"631",englishTerm:"Series",englishDefinition:'A <span class="font-bold text-[#0055B2]">series</span> is the sum of the terms of a sequence.',spanishTerm:"Serie",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">serie</span> es la suma de los términos de una secuencia.'},{tid:"633",englishTerm:"Set-builder notation",englishDefinition:'A notation used to describe the elements of a set using <span class="font-bold text-[#0055B2]">set-builder notation</span>.',spanishTerm:"Notación conjuntista",spanishDefinition:'<span class="font-bold text-[#0055B2]">Notación conjuntista</span> es la notación que se usa para describir los elementos de un conjunto.'},{tid:"635",englishTerm:"Sigma notation",englishDefinition:'<span class="font-bold text-[#0055B2]">Sigma notation</span> denotes a sum of terms. The terms to be added are formed by evaluating an expression for a specified range of values.',spanishTerm:"Notación sigma",spanishDefinition:'La <span class="font-bold text-[#0055B2]">notación sigma</span> es la suma de n términos de una progresión.'},{tid:"636",englishTerm:"Similar figures",englishDefinition:'<span class="font-bold text-[#0055B2]">Similar figures</span> are two figures that have the same shape, but not necessarily the same size.',spanishTerm:"Figuras semejantes",spanishDefinition:'Las <span class="font-bold text-[#0055B2]">figuras semejantes</span> son dos figuras que tienen la misma forma pero no son necesariamente del mismo tamaño.'},{tid:"637",englishTerm:"Similar polygons",englishDefinition:'<span class="font-bold text-[#0055B2]">Similar polygons</span> are polygons having corresponding angles congruent and the lengths of corresponding sides proportional.',spanishTerm:"Polígonos semejantes",spanishDefinition:'Los <span class="font-bold text-[#0055B2]">polígonos semejantes</span> son polígonos cuyos ángulos correspondientes son congruentes y las longitudes de los lados correspondientes son proporcionales.'},{tid:"638",englishTerm:"Similar solids",englishDefinition:'<span class="font-bold text-[#0055B2]">Similar solids</span> have the same shape and all their corresponding dimensions are proportional.',spanishTerm:"Cuerpos geométricos semejantes",spanishDefinition:'Los <span class="font-bold text-[#0055B2]">cuerpos geométricos semejantes</span> tienen la misma forma y todas sus dimensiones correspondientes son proporcionales.'},{tid:"639",englishTerm:"Similarity transformation",englishDefinition:'A composition of one or more rigid motions is a dilation, known as a <span class="font-bold text-[#0055B2]">similarity transformation</span>.',spanishTerm:"Transformación de semejanza",spanishDefinition:'Ver <span class="font-bold text-[#0055B2]">transformación de semejanza</span>.'},{tid:"640",englishTerm:"Simple interest",englishDefinition:'Interest calculated based solely on the principal amount is called <span class="font-bold text-[#0055B2]">simple interest</span>.',spanishTerm:"Interés simple",spanishDefinition:'El <span class="font-bold text-[#0055B2]">interés simple</span> es el interés basado en el capital solamente.'},{tid:"641",englishTerm:"Simple random sample",englishDefinition:'A <span class="font-bold text-[#0055B2]">simple random sample</span> is a sample where each member of the population is equally likely to be chosen, and for all n, each sample of size n is equally likely to be chosen.',spanishTerm:"Muestra aleatoria simple",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">muestra aleatoria simple</span> es una muestra donde la probabilidad de ser seleccionado es igual para todos los miembros de la población, y para todos los valores de n, la probabilidad de ser seleccionado es igual para cada muestra de tamaño n.'},{tid:"645",englishTerm:"Simulation",englishDefinition:'A <span class="font-bold text-[#0055B2]">simulation</span> is a model that imitates one or more events.',spanishTerm:"Simulación",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">simulación</span> es un modelo que imita uno o más sucesos.'},{tid:"647",englishTerm:"Sine curve",englishDefinition:'A <span class="font-bold text-[#0055B2]">sine curve</span> is the graph of a sine function.',spanishTerm:"Sinusoide",spanishDefinition:'<span class="font-bold text-[#0055B2]">Sinusoide</span> es la gráfica de la función seno.'},{tid:"650",englishTerm:"Singular matrix",englishDefinition:'A <span class="font-bold text-[#0055B2]">singular matrix</span> is a square matrix with no inverse. Its determinant is 0.',spanishTerm:"Matriz singular",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">matriz singular</span> es una matriz al cuadrado que no tiene inverso. El determinante de la matriz es 0.'},{tid:"651",englishTerm:"Skewed distribution",englishDefinition:'A <span class="font-bold text-[#0055B2]">skewed distribution</span> is a distribution whose shape is stretched out in either the positive or negative direction.',spanishTerm:"Distribución asimétrica",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">distribución asimétrica</span> es una distribución cuya forma se extiende en dirección positiva o en dirección negativa.'},{tid:"652",englishTerm:"Skew lines",englishDefinition:'<span class="font-bold text-[#0055B2]">Skew lines</span> are lines that do not lie in the same plane.',spanishTerm:"Rectas cruzadas",spanishDefinition:'Las <span class="font-bold text-[#0055B2]">rectas cruzadas</span> son rectas que no están en el mismo plano.'},{tid:"665",englishTerm:"Sphere",englishDefinition:'A <span class="font-bold text-[#0055B2]">sphere</span> is the set of all points in space that are a given distance r, the radius, from a given point C, the center. A great circle is the intersection of a sphere with a plane containing the center of the sphere. The circumference of a sphere is the circumference of any great circle of the sphere.',spanishTerm:"Esfera",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">esfera</span> es el conjunto de los puntos del espacio que están a una distancia dada r, el radio, de un punto dado C, el centro. Un círculo máximo es la intersección de una esfera y un plano que contiene el centro de la esfera. La circunferencia de una esfera es la circunferencia de cualquier círculo máximo de la esfera.'},{tid:"666",englishTerm:"Spherical geometry",englishDefinition:'In <span class="font-bold text-[#0055B2]">spherical geometry</span>, a plane is considered to be the surface of a sphere and a line is considered to be a great circle of the sphere. In spherical geometry, through a point not on a given line there is no line parallel to the given line.',spanishTerm:"Geometría esférica",spanishDefinition:'En la <span class="font-bold text-[#0055B2]">geometría esférica</span>, un plano es la superficie de una esfera y una recta es un círculo máximo de la esfera. En la geometría esférica, a través de un punto que no está en una recta dada, no hay recta paralela a la recta dada.'},{tid:"668",englishTerm:"Square matrix",englishDefinition:'A <span class="font-bold text-[#0055B2]">square matrix</span> is a matrix with the same number of columns as rows.',spanishTerm:"Matriz cuadrada",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">matriz cuadrada</span> es la que tiene la misma cantidad de columnas y filas.'},{tid:"670",englishTerm:"Square root equation",englishDefinition:'A <span class="font-bold text-[#0055B2]">square root equation</span> is a radical equation in which the radical has index 2.',spanishTerm:"Ecuación de raíz cuadrada",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">ecuación de raíz cuadrada</span> es una ecuación radical en la cual el radical tiene índice 2.'},{tid:"671",englishTerm:"Square root function",englishDefinition:'A <span class="font-bold text-[#0055B2]">square root function</span> is a function that contains the independent variable in the radicand.',spanishTerm:"Pregunta estadística",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">pregunta estadística</span> es una pregunta que se puede responder reuniendo mucha información, o datos, y resumiéndola.'},{tid:"673",englishTerm:"Standard deviation",englishDefinition:'A measure of how data varies, or deviates, from the mean, is known as the <span class="font-bold text-[#0055B2]">standard deviation</span>.',spanishTerm:"Variable estadística",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">variable estadística</span> es una cantidad o cualidad para la cual se anticipan variaciones en los datos.'},{tid:"683",englishTerm:"Standard normal distribution",englishDefinition:'The <span class="font-bold text-[#0055B2]">standard normal distribution</span> is a normal distribution with mean 0 and standard deviation 1.',spanishTerm:"Forma normal de la ecuación de una hipérbola",spanishDefinition:'La <span class="font-bold text-[#0055B2]">forma normal de la ecuación de una hipérbola</span> con centro en el origen es x^2/a^2 - y^2/b^2 = 1 donde la hipérbola se abre de forma horizontal.'},{tid:"684",englishTerm:"Standard position",englishDefinition:'An angle in the coordinate plane is in <span class="font-bold text-[#0055B2]">standard position</span> when the vertex is at the origin and one ray is on the positive x-axis.',spanishTerm:"Forma normal de la ecuación de una elipse",spanishDefinition:'La <span class="font-bold text-[#0055B2]">forma normal de la ecuación de una elipse</span> con centro en el origen es x^2/b^2 - y^2/a^2 = 1 donde el eje mayor es vertical y x^2/a^2 + y^2/b^2 = 1 cuando el eje mayor es horizontal.'},{tid:"685",englishTerm:"Stem-and-leaf plot",englishDefinition:'A <span class="font-bold text-[#0055B2]">stem-and-leaf plot</span> is a display of data made by using the digits of the values.',spanishTerm:"Distribución normal estándar",spanishDefinition:'La <span class="font-bold text-[#0055B2]">distribución normal estándar</span> es una distribución normal con una media de 0 y una desviación típica de uno.'},{tid:"686",englishTerm:"Step function",englishDefinition:'A <span class="font-bold text-[#0055B2]">step function</span> pairs every number in an interval with a single value. The graph of a step function can look like the steps of a staircase.',spanishTerm:"Posición estándar",spanishDefinition:'Un ángulo en el plano de coordenadas se encuentra en <span class="font-bold text-[#0055B2]">posición estándar</span> si el vértice se encuentra en el origen y una semirrecta se encuentra en el eje x positivo.'},{tid:"687",englishTerm:"Straight angle",englishDefinition:'A <span class="font-bold text-[#0055B2]">straight angle</span> is an angle whose measure is 180 degrees.',spanishTerm:"Diagrama de tallo y hojas",spanishDefinition:'Un arreglo de los datos que usa los dígitos de los valores en el <span class="font-bold text-[#0055B2]">diagrama de tallo y hojas</span>.'},{tid:"688",englishTerm:"Straightedge",englishDefinition:'A <span class="font-bold text-[#0055B2]">straightedge</span> is a ruler with no markings on it.',spanishTerm:"Función escalón",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">función escalón</span> empareja cada número de un intervalo con un solo valor. La gráfica de una función escalón se puede parecer a los peldaños de una escalera.'},{tid:"689",englishTerm:"Statistic",englishDefinition:'A <span class="font-bold text-[#0055B2]">statistic</span> is a piece of data from a sample, not a whole population.',spanishTerm:"Ángulo llano",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">ángulo llano</span> es un ángulo que mide 180.'},{tid:"690",englishTerm:"Statistical question",englishDefinition:'A <span class="font-bold text-[#0055B2]">statistical question</span> is a question that can be answered by collecting many pieces of information, or data, and summarizing the data.',spanishTerm:"Regla sin graduación",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">regla sin graduación</span> no tiene marcas'},{tid:"691",englishTerm:"Statistical variable",englishDefinition:'A <span class="font-bold text-[#0055B2]">statistical variable</span> is a quantity or quality for which data are expected to differ.',spanishTerm:"Estadística",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">estadística</span> es un dato tomado de una muestra, no de una población completa.'},{tid:"693",englishTerm:"Subset",englishDefinition:'A <span class="font-bold text-[#0055B2]">subset</span> of a set consists of elements from the given set.',spanishTerm:"Subconjunto",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">subconjunto</span> de un conjunto consiste en elementos del conjunto dado.'},{tid:"694",englishTerm:"Substitution method",englishDefinition:'A method of solving a system of equations by replacing one variable with an equivalent expression containing the other variable using the <span class="font-bold text-[#0055B2]">substitution method</span>.',spanishTerm:"Método de sustitución",spanishDefinition:'<span class="font-bold text-[#0055B2]">Método de sustitución</span> es un método para resolver un sistema de ecuaciones en el que se reemplaza una variable por una expresión equivalente que contenga la otra variable.'},{tid:"696",englishTerm:"Supplementary angles",englishDefinition:'Two angles are <span class="font-bold text-[#0055B2]">supplementary angles</span> if the sum of their measures is 180 degrees.',spanishTerm:"Ángulos suplementarios",spanishDefinition:'Los <span class="font-bold text-[#0055B2]">ángulos suplementarios</span> son dos ángulos cuyas medidas suman 180.'},{tid:"697",englishTerm:"Surface area",englishDefinition:'The <span class="font-bold text-[#0055B2]">surface area</span> of a prism, cylinder, pyramid, or cone is the sum of the lateral area and the areas of the bases. The surface area of a sphere is four times the area of a great circle.',spanishTerm:"Área",spanishDefinition:'El <span class="font-bold text-[#0055B2]">área</span> de un prisma, pirámide, cilindro o cono es la suma del área lateral y las áreas de las bases. El área de una esfera es igual a cuatro veces el área de un círculo máximo.'},{tid:"698",englishTerm:"Survey",englishDefinition:'In a <span class="font-bold text-[#0055B2]">survey</span>, you ask every member of a sample the same set of questions.',spanishTerm:"Encuesta",spanishDefinition:'En una <span class="font-bold text-[#0055B2]">encuesta</span>, se le hace a cada miembro de una muestra la misma serie de preguntas.'},{tid:"699",englishTerm:"Symmetric distribution",englishDefinition:'A <span class="font-bold text-[#0055B2]">symmetric distribution</span> is a distribution whose shape is evenly distributed around the mean.',spanishTerm:"Distribución simétrica",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">distribución simétrica</span> es una distribución cuya forma está distribuida en forma pareja alrededor de la media.'},{tid:"703",englishTerm:"System of equations",englishDefinition:'A <span class="font-bold text-[#0055B2]">system of equations</span> is a set of two or more equations using the same variables.',spanishTerm:"Sistema de ecuaciones",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">sistema de ecuaciones</span> es un conjunto de dos o más ecuaciones que contienen las mismas variables.'},{tid:"706",englishTerm:"Systematic sample",englishDefinition:'In a <span class="font-bold text-[#0055B2]">systematic sample</span> you order the population in some way, and then select from it at regular intervals.',spanishTerm:"Muestra sistemática",spanishDefinition:'En una <span class="font-bold text-[#0055B2]">muestra sistemática</span> se ordena la población de cierta manera y luego se selecciona una muestra de esa población a intervalos regulares.'},{tid:"714",englishTerm:"Terminal point",englishDefinition:'The <span class="font-bold text-[#0055B2]">terminal point</span> of a vector is the tip (not the endpoint) of a vector arrow.',spanishTerm:"Punto terminal",spanishDefinition:'El <span class="font-bold text-[#0055B2]">punto terminal</span> de un vector es la punta (no el extremo) de una flecha vectorial.'},{tid:"716",englishTerm:"Theorem",englishDefinition:'A <span class="font-bold text-[#0055B2]">theorem</span> is a conjecture that is proven.',spanishTerm:"Teorema",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">teorema</span> es una conjetura que se demuestra.'},{tid:"720",englishTerm:"Translation",englishDefinition:'A <span class="font-bold text-[#0055B2]">translation</span> shifts the graph of the parent function horizontally, vertically, or both without changing its shape or orientation.',spanishTerm:"Traslación",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">traslación</span> desplaza la gráfica de la función madre horizontalmente, verticalmente o en ambas direcciones, sin cambiar su forma u orientación.'},{tid:"721",englishTerm:"Transversal",englishDefinition:'A <span class="font-bold text-[#0055B2]">transversal</span> is a line that intersects two or more lines at distinct points.',spanishTerm:"Transversal",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">transversal</span> es una línea que interseca dos o más líneas en puntos precisos.'},{tid:"722",englishTerm:"Transverse axis",englishDefinition:'The <span class="font-bold text-[#0055B2]">transverse axis</span> of a hyperbola is the segment that is on the line containing the foci and has endpoints on the hyperbola.',spanishTerm:"Eje transversal",spanishDefinition:'El <span class="font-bold text-[#0055B2]">eje transversal</span> de una hipérbola es el segmento que se encuentra sobre la línea que contiene los focos y tiene sus puntos extremos sobre la hipérbola.'},{tid:"723",englishTerm:"Trapezoid",englishDefinition:'A <span class="font-bold text-[#0055B2]">trapezoid</span> is a quadrilateral with exactly one pair of parallel sides, the bases. The nonparallel sides are called the legs of the trapezoid. Each pair of angles adjacent to a base are base angles of the trapezoid. An altitude of a trapezoid is a perpendicular segment from one base to the line containing the other base. Its length is called the height of the trapezoid.',spanishTerm:"Trapecio",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">trapecio</span> es un cuadrilátero con exactamente un par de lados paralelos, las bases. Los lados no paralelos se llaman los catetos del trapecio. Cada par de ángulos adyacentes a la base son los ángulos de base del trapecio. Una altura del trapecio es un segmento perpendicular que va de una base a la recta que contiene la otra base. Su longitud se llama, por extensión, la altura del trapecio.'},{tid:"724",englishTerm:"Trend line",englishDefinition:'A <span class="font-bold text-[#0055B2]">trend line</span> is a line on a scatter plot drawn near the points that shows a correlation.',spanishTerm:"Línea de tendencia",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">línea de tendencia</span> es una línea que aproxima la relación entre dos variables o conjunto de datos de un diagrama de dispersión.'},{tid:"726",englishTerm:"Trigonometric identity",englishDefinition:'A <span class="font-bold text-[#0055B2]">trigonometric identity</span> in one variable is a trigonometric equation that is true for all values of the variable for which both sides of the equation are defined.',spanishTerm:"Identidad trigonométrica",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">identidad trigonométrica</span> en una variable es una ecuación trigonométrica que es verdadera para todos los valores de la variable para los cuales se definen los dos lados de la ecuación.'},{tid:"728",englishTerm:"Trinomial",englishDefinition:'A <span class="font-bold text-[#0055B2]">trinomial</span> is a polynomial of three terms.',spanishTerm:"Trinomio",spanishDefinition:'Polinomio compuesto de tres términos que se denomina <span class="font-bold text-[#0055B2]">trinomio</span>.'},{tid:"729",englishTerm:"Truth table",englishDefinition:'A <span class="font-bold text-[#0055B2]">truth table</span> is a table that lists all the possible combinations of truth values for two or more statements.',spanishTerm:"Tabla de verdad",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">tabla de verdad</span> es una tabla que muestra todas las combinaciones posibles de valores de verdad de dos o más enunciados.'},{tid:"730",englishTerm:"Truth value",englishDefinition:'The <span class="font-bold text-[#0055B2]">truth value</span> of a statement is true or false according to whether the statement is true or false, respectively.',spanishTerm:"Valor verdadero",spanishDefinition:'El <span class="font-bold text-[#0055B2]">valor verdadero</span> de un enunciado es &quot;verdadero&quot; o &quot;falso&quot; según el enunciado sea verdadero o falso, respectivamente.'},{tid:"731",englishTerm:"Turning point",englishDefinition:'A <span class="font-bold text-[#0055B2]">turning point</span> of the graph of a function is a point where the graph changes direction from upwards to downwards or from downwards to upwards.',spanishTerm:"Punto de giro",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">punto de giro</span> de la gráfica de una función es un punto donde la gráfica cambia de dirección de arriba hacia abajo o vice versa.'},{tid:"734",englishTerm:"Uniform distribution",englishDefinition:'A <span class="font-bold text-[#0055B2]">uniform distribution</span> is a probability distribution that is equal for each event in the sample space.',spanishTerm:"Distribución uniforme",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">distribución uniforme</span> es una distribución de probabilidad que es igual para cada suceso en el espacio muestral.'},{tid:"735",englishTerm:"Union",englishDefinition:'The <span class="font-bold text-[#0055B2]">union</span> is the set that contains all of the elements of two or more sets.',spanishTerm:"Unión",spanishDefinition:'El conjunto que contiene todos los elementos de dos o más conjuntos, formando una <span class="font-bold text-[#0055B2]">unión</span>.'},{tid:"736",englishTerm:"Unit analysis",englishDefinition:'Including units for each quantity in a calculation to determine the unit of the answer through <span class="font-bold text-[#0055B2]">unit analysis</span>.',spanishTerm:"Análisis de unidades",spanishDefinition:'Incluir unidades para cada cantidad de un cálculo como ayuda para determinar la unidad que se debe usar para la respuesta en el <span class="font-bold text-[#0055B2]">análisis de unidades</span>.'},{tid:"737",englishTerm:"Unit circle",englishDefinition:'The <span class="font-bold text-[#0055B2]">unit circle</span> has a radius of 1 unit and its center is at the origin of the coordinate plane.',spanishTerm:"Círculo unitario",spanishDefinition:'El <span class="font-bold text-[#0055B2]">círculo unitario</span> tiene un radio de 1 unidad y el centro está situado en el origen del plano de coordenadas.'},{tid:"738",englishTerm:"Unit rate",englishDefinition:'A <span class="font-bold text-[#0055B2]">unit rate</span> is a rate with a denominator of 1.',spanishTerm:"Razón en unidades",spanishDefinition:'<span class="font-bold text-[#0055B2]">Razón en unidades</span> que tiene un denominador de 1.'},{tid:"739",englishTerm:"Univariate",englishDefinition:'A set of data that uses only one variable is <span class="font-bold text-[#0055B2]">univariate</span>.',spanishTerm:"Univariado",spanishDefinition:'Un conjunto de datos que tiene sólo una variable es <span class="font-bold text-[#0055B2]">univariado</span>.'},{tid:"740",englishTerm:"Universal set",englishDefinition:'The <span class="font-bold text-[#0055B2]">universal set</span> is the set of all possible elements from which subsets are formed.',spanishTerm:"Conjunto universal",spanishDefinition:'<span class="font-bold text-[#0055B2]">Conjunto universal</span> de todos los posibles elementos específicos del cual se forma un subconjunto.'},{tid:"741",englishTerm:"Unlike radicals",englishDefinition:'<span class="font-bold text-[#0055B2]">Unlike radicals</span> are the radical expressions that do not have the same radicands.',spanishTerm:"Radicales no semejantes",spanishDefinition:'Expresiones radicales que no tienen radicandos semejantes y que son <span class="font-bold text-[#0055B2]">radicales no semejantes</span>.'},{tid:"744",englishTerm:"Variable matrix",englishDefinition:'When representing a system of equations with a matrix equation, the matrix containing the variables of the system is the <span class="font-bold text-[#0055B2]">variable matrix</span>.',spanishTerm:"Matriz variable",spanishDefinition:'Al representar un sistema de ecuaciones con una ecuación de matricial, la matriz que contenga las variables del sistema es la <span class="font-bold text-[#0055B2]">matriz variable</span>.'},{tid:"745",englishTerm:"Variable quantity",englishDefinition:'A <span class="font-bold text-[#0055B2]">variable quantity</span> can have values that vary.',spanishTerm:"Cantidad variable",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">cantidad variable</span> puede tener valores que varían.'},{tid:"746",englishTerm:"Variance",englishDefinition:'<span class="font-bold text-[#0055B2]">Variance</span> is the square of the standard deviation.',spanishTerm:"Varianza",spanishDefinition:'La <span class="font-bold text-[#0055B2]">varianza</span> es el cuadrado de la desviación estándar.'},{tid:"747",englishTerm:"Vector",englishDefinition:'A <span class="font-bold text-[#0055B2]">vector</span> is a mathematical object that has both magnitude and direction.',spanishTerm:"Vector",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">vector</span> es un objeto matemático que tiene tanto magnitud como dirección.'},{tid:"753",englishTerm:"Vertical angles",englishDefinition:'<span class="font-bold text-[#0055B2]">Vertical angles</span> are two angles whose sides form two pairs of opposite rays.',spanishTerm:"Ángulos opuestos por el vértice",spanishDefinition:'Dos ángulos son <span class="font-bold text-[#0055B2]">ángulos opuestos por el vértice</span> si sus lados son semirrectas opuestas.'},{tid:"754",englishTerm:"Vertical compression",englishDefinition:'A <span class="font-bold text-[#0055B2]">vertical compression</span> reduces all y-values of a function by the same factor between 0 and 1.',spanishTerm:"Compresión vertical",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">compresión vertical</span> reduce todos los valores de y de una función por el mismo factor entre 0 y 1.'},{tid:"756",englishTerm:"Vertical stretch",englishDefinition:'A <span class="font-bold text-[#0055B2]">vertical stretch</span> multiplies all y-values of a function by the same factor greater than 1.',spanishTerm:"Estiramiento vertical",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">estiramiento vertical</span> multiplica todos los valores de y por el mismo factor mayor que 1.'},{tid:"757",englishTerm:"Vertical-line test",englishDefinition:'You can use the <span class="font-bold text-[#0055B2]">vertical-line test</span> on the graph of a relation to tell whether the relation is a function. If a vertical line passes through more than one point on the graph of a relation, then the relation is not a function.',spanishTerm:"Prueba de la recta vertical",spanishDefinition:'Puedes usar la <span class="font-bold text-[#0055B2]">prueba de la recta vertical</span> en la gráfica de una relación para saber si la relación es una función. Si una línea vertical pasa por más de un punto de la gráfica de la relación, entonces la relación no es una función.'},{tid:"761",englishTerm:"Whole numbers",englishDefinition:'The nonnegative integers, which are also known as <span class="font-bold text-[#0055B2]">whole numbers</span>.',spanishTerm:"Números enteros no negativos",spanishDefinition:'Todos los <span class="font-bold text-[#0055B2]">números enteros no negativos</span> que no son negativos.'},{tid:"762",englishTerm:"x-axis",englishDefinition:'The <span class="font-bold text-[#0055B2]">x-axis</span> is the horizontal axis of the coordinate plane.',spanishTerm:"Eje x",spanishDefinition:'El <span class="font-bold text-[#0055B2]">eje x</span> es el eje horizontal del plano de coordenadas.'},{tid:"763",englishTerm:"x-coordinate",englishDefinition:'The <span class="font-bold text-[#0055B2]">x-coordinate</span> is the first number in an ordered pair, specifying the distance left or right of the y-axis of a point in the coordinate plane.',spanishTerm:"Coordenada x",spanishDefinition:'El primer número de un par ordenado, que indica la distancia a la izquierda o a la derecha del eje y de un punto en el plano coordenadas, que se conoce como <span class="font-bold text-[#0055B2]">coordenada x</span>.'},{tid:"765",englishTerm:"y-axis",englishDefinition:'The <span class="font-bold text-[#0055B2]">y-axis</span> is the vertical axis of the coordinate plane.',spanishTerm:"Eje y",spanishDefinition:'El eje vertical del plano de coordenadas que se denomina <span class="font-bold text-[#0055B2]">eje y</span>.'},{tid:"766",englishTerm:"y-coordinate",englishDefinition:'The <span class="font-bold text-[#0055B2]">y-coordinate</span> is the second number in an ordered pair, specifying the distance above or below the x-axis of a point in the coordinate plane.',spanishTerm:"Coordenada y",spanishDefinition:'La <span class="font-bold text-[#0055B2]">coordenada y</span> es el segundo número de un par ordenado, que indica la distancia arriba o abajo del eje x de un punto en el plano de coordenadas.'},{tid:"769",englishTerm:"Zero-Product Property",englishDefinition:'If the product of two or more factors is zero, then according to the <span class="font-bold text-[#0055B2]">zero-product property</span>, one of the factors must be zero.',spanishTerm:"Propiedad del producto cero",spanishDefinition:'La <span class="font-bold text-[#0055B2]">propiedad del producto cero</span> establece que si el producto de dos o más factores es cero, entonces uno de los factores debe ser cero.'},{tid:"770",englishTerm:"z-score",englishDefinition:'The <span class="font-bold text-[#0055B2]">z-score</span> of a value is the number of standard deviations that the value is from the mean.',spanishTerm:"Puntaje z",spanishDefinition:'El <span class="font-bold text-[#0055B2]">puntaje z</span> de un valor es el número de desviaciones normales que tiene ese valor de la media.'},{tid:"1",englishTerm:"Absolute value",englishDefinition:'The <span class="font-bold text-[#0055B2]">absolute value</span> of a real number, <i>x</i>, written |x|, is its distance from zero on the number line.',spanishTerm:"Valor absoluto",spanishDefinition:'El <span class="font-bold text-[#0055B2]">valor absoluto</span> de un número real, <i>x</i>, escrito |x|, es su distancia del cero en la recta numérica.'},{tid:"67",englishTerm:"Circumference",englishDefinition:'The <span class="font-bold text-[#0055B2]">circumference</span> of a circle is the distance around the circle.',spanishTerm:"Circunferencia",spanishDefinition:'La <span class="font-bold text-[#0055B2]">circunferencia</span> de un círculo es la distancia alrededor del círculo.'},{tid:"108",englishTerm:"Conditional probability",englishDefinition:'A <span class="font-bold text-[#0055B2]">conditional probability</span> contains a condition that may limit the sample space for an event.',spanishTerm:"Probabilidad condicional",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">probabilidad condicional</span> contiene una condición que puede limitar el espacio muestral de un evento.'},{tid:"146",englishTerm:"Coordinate plane",englishDefinition:'The <span class="font-bold text-[#0055B2]">coordinate plane</span> is formed by two number lines, called the axes, intersecting at right angles. The <i>x</i>-axis is the horizontal axis and the <i>y</i>-axis is the vertical axis. The two axes meet at the origin. The axes divide the plane into four <i>quadrants</i>.',spanishTerm:"Plano de coordenadas",spanishDefinition:'El <span class="font-bold text-[#0055B2]">plano de coordenadas</span> está formado por dos rectas numéricas, llamadas ejes, que se cruzan en ángulo recto. El eje <i>x</i> es el eje horizontal y el eje <i>y</i> es el eje vertical. Los dos ejes se encuentran en el origen. Los ejes dividen el plano en cuatro <i>cuadrantes</i>.'},{tid:"154",englishTerm:"Corresponding angles",englishDefinition:'<span class="font-bold text-[#0055B2]">Corresponding angles</span> lie on the same side of the transversal <i>t</i> and in corresponding positions relative to the lines that are intersected.',spanishTerm:"ángulos correspondientes",spanishDefinition:'Los <span class="font-bold text-[#0055B2]">ángulos correspondientes</span> se encuentran en el mismo lado de la <i>t</i> transversal y en posiciones correspondientes con respecto a las líneas que se cruzan.'},{tid:"395",englishTerm:"Maximum value",englishDefinition:'The <span class="font-bold text-[#0055B2]">maximum value</span> of a function is the greatest <i>y</i>-value of the function. It is the <i>y</i>-coordinate of the highest point on the graph of <i>f</i>.',spanishTerm:"Valor máximo",spanishDefinition:'El <span class="font-bold text-[#0055B2]">valor máximo</span> de una función es el mayor valor <i>y</i> de la función. Es la coordenada <i>y</i> del punto más alto de la gráfica de <i>f</i>.'},{tid:"410",englishTerm:"Minimum value",englishDefinition:'The <span class="font-bold text-[#0055B2]">minimum value</span> of a function is the least <i>y</i>-value of the function. It is the <i>y</i>-coordinate of the lowest point on the graph of <i>f</i>.',spanishTerm:"Valor mínimo",spanishDefinition:'El <span class="font-bold text-[#0055B2]">valor mínimo</span> de una función es el menor valor <i>y</i> de la función. Es la coordenada <i>y</i> del punto más bajo en la gráfica de <i>f</i>.'},{tid:"426",englishTerm:"Natural base exponential function",englishDefinition:'A <span class="font-bold text-[#0055B2]">natural base exponential function</span> is an exponential function with base <i>e</i>.',spanishTerm:"Función exponencial de base natural",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">función exponencial de base natural</span> es una función exponencial con base <i>e</i>.'},{tid:"427",englishTerm:"Natural logarithmic function",englishDefinition:'A <span class="font-bold text-[#0055B2]">natural logarithmic function</span> is a logarithmic function with base <i>e</i>.',spanishTerm:"Función logarítmica natural",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">función logarítmica natural</span> es una función logarítmica con base <i>e</i>.'},{tid:"455",englishTerm:"One-to-one function",englishDefinition:'A <span class="font-bold text-[#0055B2]">one-to-one function</span> is a function for which each <i>y</i>-value in the range corresponds to exactly one <i>x</i>-value in the domain. A one-to-one function <i>f</i> has an inverse that is also a function.',spanishTerm:"Función uno a uno",spanishDefinition:'Una <span class="font-bold text-[#0055B2]">función uno a uno</span> es una función para la cual cada valor <i>y</i> en el rango corresponde exactamente a un valor <i>x</i> en el dominio. Una función uno a uno <i>f</i> tiene una inversa que también es una función.'},{tid:"472",englishTerm:"Overlapping events",englishDefinition:'Events that have at least one common outcome in <span class="font-bold text-[#0055B2]">overlapping events</span>.',spanishTerm:"Eventos superpuestos",spanishDefinition:'<span class="font-bold text-[#0055B2]">Eventos superpuestos</span> son aquellos eventos que tienen al menos un resultado común.'},{tid:"475",englishTerm:"Parallel lines",englishDefinition:'Two lines are <span class="font-bold text-[#0055B2]">parallel lines</span> if they lie in the same plane and do not intersect.',spanishTerm:"Líneas paralelas",spanishDefinition:'Dos <span class="font-bold text-[#0055B2]">líneas paralelas</span> son dos rectas que están en el mismo plano y no se cortan.'},{tid:"493",englishTerm:"Permutation",englishDefinition:'A <span class="font-bold text-[#0055B2]">permutation</span> is an arrangement of some or all of a set of objects in a specific order.',spanishTerm:"Permutación",spanishDefinition:'Una disposición de algunos o todos los objetos en un orden específico que se denomina <span class="font-bold text-[#0055B2]">permutación</span>.'},{tid:"504",englishTerm:"Point of discontinuity",englishDefinition:'A <span class="font-bold text-[#0055B2]">point of discontinuity</span> is the <i>x</i>-coordinate of a point where the graph of the function is not continuous.',spanishTerm:"Punto de discontinuidad",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">punto de discontinuidad</span> es la coordenada <i>x</i> de un punto donde la gráfica de la función no es continua.'},{tid:"608",englishTerm:"Same-side interior angles",englishDefinition:'<span class="font-bold text-[#0055B2]">Same-side interior angles</span> lie on the same side of the transversal <i>t</i> and between the lines being intersected.',spanishTerm:"Ángulos interiores del mismo lado",spanishDefinition:'Los <span class="font-bold text-[#0055B2]">ángulos interiores del mismo lado</span> se encuentran en el mismo lado de la <i>t</i> transversal y entre las líneas que se cruzan.'},{tid:"661",englishTerm:"Solution of an equation (two variables)",englishDefinition:"A solution of an equation (two variables) with the variables <i>x</i> and <i>y</i> is any ordered pair that makes the equation true.",spanishTerm:"Solución de una ecuación (dos variables)",spanishDefinition:"Una solución de una ecuación (dos variables) es cualquier par ordenado de las variables <i>x</i> y <i>y</i> que haga que la ecuación sea verdadera."},{tid:"768",englishTerm:"Zero of a function",englishDefinition:'A <span class="font-bold text-[#0055B2]">zero of a function</span> is any input value for which the function is equal to zero.',spanishTerm:"Cero de una función",spanishDefinition:'Un <span class="font-bold text-[#0055B2]">cero de una función</span> es cualquier valor de entrada para el cual la función es igual a cero.'}];export{e as default};
